ist and describe on your website but is sold elsewhere.'=>'<b>Внешний или аффилированный —</b> товар, который вы указываете и описываете на своём веб-сайте, но продаётся в другом месте.','<b>Grouped –</b> a collection of related products that can be purchased individually and only consist of simple products. For example, a set of six drinking glasses.'=>'<b>Сборный —</b> коллекция связанных товаров, которые можно приобрести по-отдельности и которые включат в себя только простые товары. Например, набор из шести стеклянных бокалов.','<b>Shipment %1$s</b> was shipped on <b>%2$s</b>'=>'<b>Отгрузка %1$s</b> осуществлена <b>%2$s</b>','<b>Simple –</b> covers the vast majority of any products you may sell. Simple products are shipped and have no options. For example, a book.'=>'<b>Простой —</b> подходит для большинства товаров, которые можно продавать. Простые товары могут быть доставлены и не имеют опций. Например, книга.','<b>To</b>: %s'=>'<b>Кому</b>: %s','<b>Variable –</b> a product with variations, each of which may have a different SKU, price, stock option, etc. For example, a t-shirt available in different colors and/or sizes.'=>'<b>Вариативный —</b> товар с вариациями, каждая из которых может иметь свои артикул, цену, опции и т. д. Например, футболки могут быть разных цветов и/или размеров.','<strong>%s order</strong> awaiting processing'=>'<strong>%s заказ</strong> ожидает обработки' . "\0" . '<strong>%s заказа</strong> ожидают обработки' . "\0" . '<strong>%s заказов</strong> ожидают обработки','<strong>%s order</strong> on-hold'=>'<strong>%s заказ</strong> на удержании' . "\0" . '<strong>%s заказа</strong> на удержании' . "\0" . '<strong>%s заказов</strong> на удержании','<strong>%s product</strong> low in stock'=>'<strong>%s товар</strong> на исходе' . "\0" . '<strong>%s товара</strong> на исходе' . "\0" . '<strong>%s товаров</strong> на исходе','<strong>%s product</strong> out of stock'=>'<strong>%s товар</strong> нет в наличии' . "\0" . '<strong>%s товара</strong> нет в наличии' . "\0" . '<strong>%s товаров</strong> нет в наличии','<strong>Action Scheduler:</strong> %1$d <a href="%2$s">past-due action</a> found; something may be wrong. <a href="https://actionscheduler.org/faq/#my-site-has-past-due-actions-what-can-i-do" target="_blank">Read documentation &raquo;</a>'=>'<strong>Планировщик действий:</strong>найдено %1$d <a href="%2$s">просроченное действие</a>; возможно, что-то не так. <a href="https://actionscheduler.org/faq/#my-site-has-past-due-actions-what-can-i-do" target="_blank">Прочитать документацию</a>' . "\0" . '<strong>Планировщик действий:</strong>найдено %1$d <a href="%2$s">просроченных действия</a>; возможно, что-то не так. <a href="https://actionscheduler.org/faq/#my-site-has-past-due-actions-what-can-i-do" target="_blank">Прочитать документацию</a>' . "\0" . '<strong>Планировщик действий:</strong>найдено %1$d <a href="%2$s">просроченных действий</a>; возможно, что-то не так. <a href="https://actionscheduler.org/faq/#my-site-has-past-due-actions-what-can-i-do" target="_blank">Прочитать документацию</a>','<strong>Heads up!</strong> The versions of the following plugins you\'re running haven\'t been tested with WooCommerce %s. Please update them or confirm compatibility before updating WooCommerce, or you may experience issues:'=>'<strong>Внимание!</strong> Версии следующих используемых плагинов не тестировались с WooCommerce %s. Пожалуйста, обновите их для гарантированной работоспособности перед обновлением WooCommerce, или вы можете испытать проблемы:','<strong>Sandbox mode enabled</strong>. Only sandbox test accounts can be used. See the <a href="%s">PayPal Sandbox Testing Guide</a> for more details.'=>'<strong>Включен режим песочницы</strong>. Можно использовать только тестовые учётные записи песочницы. Подробную информацию смотрите в <a href="%s">руководстве по тестированию PayPal в песочнице</a>.','<strong>Welcome to WooCommerce</strong> &#8211; You&lsquo;re almost ready to start selling :)'=>'<strong>Добро пожаловать в WooCommerce</strong> &#8211; Вы почти готовы к продажам :)','<strong>Your theme (%s) contains outdated copies of some WooCommerce template files.</strong> These files may need updating to ensure they are compatible with the current version of WooCommerce. Suggestions to fix this:'=>'<strong>В вашей теме (%s) содержатся устаревшие копии нескольких шаблонов WooCommerce.</strong> Возможно, эти шаблоны потребуется обновить, чтобы обеспечить совместимость с текущей версией WooCommerce. Предлагаем выполнить следующее:','<strong>You’re editing details specific to this variation.</strong> Some information, like description and images, will be inherited from the main product, <noticeLink><parentProductName/></noticeLink>.'=>'<strong>Вы редактируете детали, характерные для данной вариации</strong>. Некоторая информация, такая как описание и изображения, будет унаследована от основного товара <noticeLink><parentProductName/></noticeLink>.','[%1$s] %2$s: %3$s WooCommerce log message'=>'[%1$s] %2$s: %3$s сообщение журнала WooCommerce' . "\0" . '[%1$s] %2$s: %3$s сообщения журнала WooCommerce' . "\0" . '[%1$s] %2$s: %3$s сообщений журнала WooCommerce','[%1$s] Payment gateway "%2$s" enabled'=>'[%1$s] Платёжный шлюз "%2$s" включён','[deleted]'=>'[Удалено]','[Failed] Orders table could not be created.'=>'[Ошибка] Не удалось создать таблицу заказов.','[Failed] Some installed plugins are incompatible. Please review the plugins by going to WooCommerce > Settings > Advanced > Features and see the "Order data storage" section.'=>'[Failed] Some installed plugins are incompatible. Please review the plugins by going to WooCommerce > Settings > Advanced > Features and see the "Раздел «Хранилище данных заказов».','[Failed] The orders table does not exist and this is not a new shop. Please create the table by going to WooCommerce > Settings > Advanced > Features and enabling sync.'=>'[Ошибка] Таблица заказов отсутствует, и это не новый магазин. Чтобы создать таблицу, перейдите в «WooCommerce > Настройки > Дополнительно > Функции и включение синхронизации».','[Failed] There are orders pending sync. Please run `%s` to sync pending orders.'=>'[Ошибка] Имеются заказы, ожидающие синхронизации. Выполните «%s» для синхронизации оставшихся заказов.','[Failed] This is not a new shop, but --for-new-shop flag was passed.'=>'[Ошибка] Это не новый магазин, однако была обнаружена отметка --for-new-shop.','[Order #%1$s] (%2$s)'=>'[Заказ № %1$s] (%2$s)','[Order #%s]'=>'[Заказ № %s]','[Performance] Removes session cookies for non-logged in customers when session data is empty, improving page caching performance. May cause compatibility issues with extensions that depend on the session cookie without using session data.'=>'[Производительность] Удаляет сессионные куки неавторизованных клиентов, когда данные сессии пусты, что повышает производительность кэширования страниц. Может вызвать проблемы совместимости с расширениями, зависящими от сессионных куки, но не используют данные сессии.','[product description rendering halted]'=>'[отображение описания товара приостановлено]','[Remove]'=>'[Убрать]','[{site_title}]: New order #{order_number}'=>'[{site_title}]: Новый заказ № {order_number}','[{site_title}]: Order #{order_number} has been cancelled'=>'[{site_title}]: Заказ № {order_number} отменен','[{site_title}]: Order #{order_number} has failed'=>'[{site_title}]: Заказ № {order_number} выполнить не удалось','[{site_title}]: You\'ve got a new order: #{order_number}'=>'[{site_title}]: Поступил новый заказ: № {order_number}','[{site_title}]: Your order #{order_number} has been cancelled'=>'[{site_title}]: Ваш заказ № {order_number} был отменён','[{site_title}]: Your {report_name} Report download is ready'=>'[{site_title}]: Ваш отчёт {report_name} готов к скачиванию','A 2 digit country code, e.g. US. Leave blank to apply to all.'=>'2-хбуквенный код страны, например, US. Оставьте пустым, чтобы применить ко всем.','A 2 digit state code, e.g. AL. Leave blank to apply to all.'=>'2-буквенный код штата, например, AL. Оставьте пустым, чтобы применить ко всем.','A <a href="%s">notification</a> for the same product and customer already exists in your database.'=>'<a href="%s">Уведомление</a> для того же товара и того же клиента уже существует в вашей базе данных.','A cloud of your most used product tags.'=>'Облако наиболее используемых меток товаров.','A collection of email content layouts.'=>'Коллекция макетов содержимого электронных писем.','A Coruña'=>'Ла-Корунья','A description of the purpose of the email template.'=>'Описание назначения шаблона письма.','A European payments solution that allows you to accept payments in over 25 countries and multiple currencies.'=>'Европейский платёжный инструмент, позволяющий принимать платежи в разных валютах и в 25 странах.','A font face with slug "%s" already exists.'=>'Начертание шрифта со слагом «%s» уже существует.','A font family with slug "%s" already exists.'=>'Семейство шрифтов со слагом «%s» уже существует.','A friendly name for the webhook.'=>'Читабельное название вебзацепа.','A friendly summary of the response including the HTTP response code, message, and body.'=>'Читабельное резюме ответа, включающего код ответа HTTP, сообщение и тело.','A full checkout experience embedded on your site that includes all popular payment methods (Pay Now, Pay Later, Financing, Installments).'=>'На вашем сайте встроен полный сервис оформления заказа, включающий наиболее популярные способы оплаты (оплатить сейчас, оплатить позже, финансирование, рассрочка).','A fully embedded checkout, with all popular payment methods, for more sales and less abandoned shopping carts.'=>'Полностью встроенная касса со всеми популярными способами оплаты для увеличения продаж и уменьшения количества брошенных корзин c незавершёнными покупками.','A general template for emails.'=>'Общий шаблон для электронных писем.','a group of regions that can be assigned different shipping methods and rates.'=>'группы регионов, к которым могут быть применены определённые методы и тарифы доставки.','A human readable description for the setting used in interfaces.'=>'Понятное описание настройки для интерфейса.','A human readable label for the setting used in interfaces.'=>'Краткое понятное описание настройки для интерфейса.','A human-readable description of the resource.'=>'Описание ресурса, пригодное для прочтения человеческими существами.','A link to a product category.'=>'Ссылка на категорию товара.','A link to a product form.'=>'Ссылка на товарную форму.','A link to a product sold on a different website, e.g. brand collab.'=>'Ссылка на товар, продаваемый на другом веб-сайте, например коллаборация с брендом.','A link to a product tag.'=>'Ссылка на метку товара.','A link to a product.'=>'Ссылка на товар.','A link to set a new password will be sent to your email address.'=>'Ссылка для установки нового пароля будет отправлена ​​на ваш адрес электронной почты.','A list of line items (products) within this order.'=>'Список позиций (товаров) в рамках данного заказа.','A list of plugins to install'=>'Список плагинов для установки','A list of stats to query must be provided.'=>'Должен быть предоставлен список запрашиваемых статистических параметров.','A list of taxonomy terms that can be used in regard to order/product statuses.'=>'Список значений таксономий, которые могут быть использованы для управления статусами заказов/товаров.','A list of taxonomy terms used for product visibility.'=>'Список элементов таксономии, используемых для обозначения видимости товаров.','A list of your store\'s products.'=>'Список товаров вашего магазина.','A list of your store\'s top-rated products.'=>'Список самых рейтинговых товаров вашего магазина.','A list or dropdown of product categories.'=>'Список или выпадающий список категорий товара.','A live rate is the exact cost to ship an order, quoted directly from the shipping carrier.'=>'Текущий тариф – это точная стоимость доставки заказа, которую предлагает непосредственно транспортная компания.','A map of provider ID to integer values representing the sort order.'=>'Сопоставление идентификатора поставщика с целочисленными значениями, представляющими порядок сортировки.','A message indicating that the action completed successfully.'=>'Сообщение о выполненном действии.','A minimum order amount'=>'Сумма минимального заказа','A minimum order amount AND a coupon'=>'Минимальная сумма заказа И купон','A minimum order amount AND coupon'=>'Минимальная сумма заказа И купон','A minimum order amount OR a coupon'=>'Минимальная сумма заказа ИЛИ купон','A minimum order amount OR coupon'=>'Минимальная сумма заказа ИЛИ купон','A new queue has begun processing. <a href="%s">View actions in-progress &raquo;</a>'=>'Началась обработка новой очереди. <a href="%s">Посмотреть выполняемые действия &raquo;</a>','A note has been added to your order'=>'К вашему заказу было добавлено примечание','A note has been added to your order from {site_title}'=>'К заказу на {site_title} добавлено новое примечание','A partial IP address can be passed and matching results will be returned.'=>'Можно передать частичный IP-адрес, и будут возвращены соответствующие результаты.','A password reset email has been sent to the email address on file for your account, but may take several minutes to show up in your inbox. Please wait at least 10 minutes before attempting another reset.'=>'Письмо со ссылкой для сброса пароля было направлено на адрес электронной почты, привязанный к вашей учетной записи, доставка сообщения может занять несколько минут. Пожалуйста, подождите не менее 10 минут, прежде чем инициировать ещё один запрос.','A payment provider in the context of the main Payments Settings page list.'=>'Поставщик платёжных услуг в контексте основного списка страниц «Настройки платежей».','A product must be associated with this brand for the coupon to remain valid or, for "Product Discounts", products with these brands will be discounted.'=>'Чтобы купон действовал, товар должен относиться к этим брендам. Скидки распространяются на товары, связанные с этими брендами.','A product with this ID already exists.'=>'Товар с таким ID уже существует.','A product with this SKU already exists.'=>'Товар с таким артикулом уже есть.','A search form for your store.'=>'Форма поиска по вашему сайту.','A set of products that go well together, e.g. camera kit.'=>'Набор товаров, которые подходят друг к другу, например аксессуары к фотоаппарату.','A shipment from {site_title} order {order_number} has been cancelled'=>'Отправка из {site_title} заказа {order_number} была отменена.','A shipment from {site_title} order {order_number} has been updated'=>'Доставка с сайта {site_title} заказа {order_number} обновлена','A shipping zone consists of the region(s) you\'d like to ship to and the shipping method(s) offered. A shopper can only be matched to one zone, and we\'ll use their shipping address to show them the methods available in their area.'=>'Зона доставки состоит из регионов, в которые будут отправляться заказы, и предлагаемых способов доставки. Покупатель может быть привязан только к одной зоне, его адрес доставки будет использован для отображения ему способов, доступных в его регионе.','A shipping zone is a geographic region where a certain set of shipping methods and rates apply.'=>'Зона доставки - это географический регион, где применяется определённый набор методов и тарифов доставки.','A simple offline gateway that lets you accept a check as method of payment.'=>'Простой оффлайн-шлюз, позволяющий принимать банковские чеки в качестве оплаты.','A simple offline gateway that lets you accept BACS payment.'=>'Простой оффлайн шлюз, который позволяет принимать оплату через систему BACS.','A simple offline gateway that lets you accept cash on delivery.'=>'Простой оффлайн шлюз, который позволяет принимать оплату наличными при доставке.','A single physical or virtual product, e.g. a t-shirt or an eBook.'=>'Одиночный физический или виртуальный товар, например футболка или электронная книга.','A subject for provided email type after filters are applied and placeholders replaced.'=>'Тема эл. письма указанного типа после применения фильтров и подстановки заполнителей.','A suggestion category.'=>'Рубрика предложения.','A suggestion with full details.'=>'Предложение во всех подробностях.','A test account is already set up.'=>'Тестовая учётная запись уже настроена.','A unique ID string for the email template.'=>'Строка уникального идентификатора шаблона письма.','A unique identifier for the setting.'=>'Уникальный идентификатор настройки.','A unique identifier for the tool.'=>'Уникальный идентификатор инструмента.','A unique identifier that can be used to link settings together.'=>'Уникальный идентификатор, с помощью которого можно объединить настройки.','A URL to redirect the customer after checkout. This could be, for example, a link to the payment processors website.'=>'URL для переадресации клиентов после оформления заказа. Например, это может быть ссылка на веб-сайт платёжной системы.','A valid email address is required'=>'Необходим корректный адрес электронной почты','A valid event name must be specified.'=>'Необходимо указать допустимое название события.','A valid free shipping coupon'=>'Действующий купон на бесплатную доставку','A valid prop name must be specified'=>'Укажите допустимое название свойства','A zip file of the theme to be uploaded.'=>'Zip-файл темы для загрузки.','A ‘brewtiful’ experience :-)'=>'Чашечка счастья :-)','Aargau'=>'Аргау','Abia'=>'Абия','Abim'=>'Абим','Abort'=>'Отмена','Abort the product attributes lookup table regeneration'=>'Прервать регенерацию таблицы обзора атрибутов товара','About'=>'О нас','About Action Scheduler %s'=>'О планировщике действий %s','About WooCommerce'=>'О WooCommerce','Abra'=>'Абра','Abuja'=>'Абуджа','Accent'=>'Акцент','Accept all popular payment methods for Finnish B2C and B2B customers'=>'Приём наиболее популярные способы оплаты для финских B2C и B2B клиентов.','Accept 