ntly being loaded from the following location. This can be useful when debugging, or if requested by the support team.'=>'Планировщик действий сейчас загружается из следующего расположения. Это может потребоваться при отладке или по запросу службы поддержки.','Action Scheduler migration in progress. The list of scheduled actions may be incomplete.'=>'Выполняется перенос по расписанию планировщика действий. Список запланированных действий может быть неполным.','Action Scheduler package'=>'Пакет планировщика действий','Action Scheduler package running on your site.'=>'Пакет планировщика действий уже работает на вашем сайте.','Action Scheduler was unable to delete action %1$d. Reason: %2$s'=>'Планировщику действий не удалось удалить действие %1$d. Причина: %2$s','action started'=>'действие начато','action started via %s'=>'действие началось через %s','Action Status'=>'Статус действия','Action statuses are Pending, Complete, Canceled, Failed'=>'Статусы действий: В ожидании, Завершено, Отменено, Не выполнено','Action that should be completed to connect Jetpack.'=>'Действие, которое необходимо выполнить для подключения Jetpack.','Action to authorize the WPCOM connection.'=>'Действие для авторизации подключения WPCOM.','Action to check the step status.'=>'Действие для проверки статуса этапа.','Action to clean the step progress.'=>'Действие по сбросе хода выполнения шага.','Action to create or resume an embedded KYC session.'=>'Действие для создания или возобновления внедрённого сеанса KYC.','Action to disable the test account currently in use'=>'Действие по отключению используемой в данный момент тестовой учётной записи','Action to finish an embedded KYC session.'=>'Действие для завершения внедрённого сеанса KYC.','Action to initialize a test account.'=>'Действие для инициализации тестовой учётной записи.','Action to reset the onboarding process, either partially, for a certain step, or fully.'=>'Действие для частичного или полного перезапуска процесса адаптации на определённом этапе.','Action to save step information in the database.'=>'Действие для сохранения информации об этапе в базе данных.','Action to signal the step completion.'=>'Действие, сигнализирующее о завершении этапа.','Action to signal the step start.'=>'Действие, сигнализирующее о начале этапа.','Action to use as a fallback when dealing with errors with the embedded KYC.'=>'Действие, которое будет применяться как запасной вариант при обработке ошибок во внедрённом KYC.','action_args should not be overwritten when calling wc_get_template.'=>'Параметр action_args не должен перезаписываться при вызове wc_get_template.','Actionable order statuses'=>'Действующие статусы заказа','Actions'=>'Действия','ActionScheduler_Action::$args too long. To ensure the args column can be indexed, action args should not be more than %d characters when encoded as JSON.'=>'ActionScheduler_Action::$args имееи слишком большую длину. Для индексации столбца args аргументы действия не должны содержать символов более %d при кодировании в формате JSON.','Activate'=>'Активировать','Activate BNPL instantly on WooPayments'=>'Мгновенно активируйте BNPL в WooPayments','Activate usage tracking'=>'Активировать отслеживание использования','Active'=>'Активно','Active filters'=>'Активные фильтры','Active plugins'=>'Активные плагины','Active plugins.'=>'Активные плагины.','Active Product Filters'=>'Активные фильтры товаров','Activity log for the action.'=>'Журнал активности для данного действия.','Adamawa'=>'Адамава','Adana'=>'Адана','Add'=>'Добавить','Add "Reply-to" email'=>'Добавить письмо ответа','Add %s'=>'Добавить %s','Add a different email address to receive replies.'=>'Добавьте другой адрес электронной почты для получения ответов.','Add a link and choose a label for the button linked to a product sold elsewhere.'=>'Добавьте ссылку и выберите ярлык кнопки, связанной с товаром, продаваемым в другом месте.','Add a meaningful description, including a note of the person, company or app you are sharing the 