ый плагин PayU для WooCommerce, чтобы начать принимать платежи более чем 100 способами оплаты, доступными в вашей стране, включая кредитные карты, дебетовые карты, UPI и многое другое!','Enable Point of Sale functionality in the WooCommerce mobile apps.'=>'Включение функционала POS-терминала в мобильных приложениях WooCommerce.','Enable predictive address search'=>'Включить интеллектуальный поиск адресов','Enable product reviews'=>'Включить отзывы о товарах','Enable product visibility'=>'Включить видимость товара','Enable push notifications for the WooCommerce mobile apps to receive order notifications and store updates.'=>'Пуш-уведомления для мобильных приложений WooCommerce позволяют получать уведомления о заказах и обновлениях магазина.','Enable reviews'=>'Включить отзывы','Enable rule'=>'Активировать правило','Enable shipping debug mode to show matching shipping zones and to bypass shipping rate cache.'=>'Включение режима отладки доставки для отображения подходящих зон доставки и обхода кэша тарифов доставки.','Enable star rating on reviews'=>'Включить в отзывах рейтинг в звёздах','Enable stock management'=>'Включить управление запасами','Enable store notice'=>'Включить уведомление магазина','Enable table usage'=>'Включить использование таблицы','Enable tax rates and calculations'=>'Включить налоговые ставки и расчёты','Enable taxes'=>'Включение налогов','Enable taxes and coupons and configure how they are calculated.'=>'Включите налоги и купоны и настройте способ их расчёта.','Enable the Agentic Checkout API for AI-powered checkout experiences (e.g., ChatGPT). This adds REST API endpoints that allow AI agents to create and manage checkout sessions.'=>'API оформления заказа Agentic с использованием ИИ (например, ChatGPT) добавляет эндпойнты REST API, которые позволяют агентам ИИ создавать сеансы оформления заказа и управлять ими.','Enable the block-based email editor for transactional emails.'=>'Включите редактор электронной почты на основе блоков для транзакционных писем.','Enable the Order Fulfillments feature to manage order fulfillment and shipping.'=>'Включите функцию «Выполнения заказов», чтобы управлять выполнением и доставкой заказов.','Enable the shipping calculator on the cart page'=>'Включить калькулятор стоимости доставки в корзине','Enable the site visibility badge in the WordPress admin bar'=>'Индикатор видимости сайта в панели администратора WordPress','Enable the use of coupon codes'=>'Включить использование купонов','Enable this email notification'=>'Включить это Email-оповещение','Enable this feature to track and credit channels and campaigns that contribute to orders on your site'=>'Включите эту функцию, чтобы отслеживать и упоминать каналы и кампании, принимающие участие в заказах на вашем сайте','Enable this if you want this attribute to have product archives in your store.'=>'Позволяет просматривать списки товаров с определённым атрибутом.','Enable this option if a product is not shipped or there is no shipping cost'=>'Включите эту опцию если товар не доставляется или в нем нет уплат за доставку','Enable this option if access is given to a downloadable file upon purchase of a product'=>'Включите эту опцию если доступ предоставляется скачиваемому файлу при покупке товара','Enable this option to enable stock management at variation level'=>'Включить опцию активизации механизма управления запасами на уровне вариации','Enable this option to grant access to downloads when orders are "processing", rather than "completed".'=>'Включите эту опцию, чтобы предоставить доступ к скачиванию тогда, когда заказы "в обработке", а не "завершены".','Enable this payment gateway'=>'Включение этого платёжного шлюза','Enable tracking'=>'Разрешить отслеживание','Enable usage tracking and help improve WooCommerce'=>'Включить механизм отслеживания процесса использования и помогать улучшать WooCommerce','Enable WooCommerce Analytics'=>'Включение аналитики WooCommerce','Enable WooCommerce MCP (Model Context Protocol) for AI-powered store operations. AI-generated results and actions can be unpredictable - please review before executing in your store.'=>'Включить WooCommerce MCP (Model Context Protocol) для управления магазином с помощью ИИ. Результаты и действия, генерируемые ИИ, могут быть непредсказуемыми – пожалуйста, проверяйте их перед применением на своём сайте.','Enable/Disable'=>'Включить/Выключить','Enable/Disable attribute archives.'=>'Включить/Выключить архивы атрибутов.','Enabled'=>'Включить','Enabled Features'=>'Включённые функции','Enabled features.'=>'Активные функции.','Enabled features:'=>'Активные функции:','Enables rate limiting for Checkout place order and Store API /checkout endpoint. To further control this, refer to <a href="%s" target="_blank">rate limiting documentation</a>.'=>'Включает ограничение количества запросов при размещении заказа на оформление и конечной точки API магазина или оформления заказа. Сведения об управлении этим параметром см. в <a href="%s" target="_blank">документации по ограничению количества запросов</a>.','End date of sale price, as GMT.'=>'Дата окончания действия скидки (в формате GMT).','End date of sale price, in the site\'s timezone.'=>'Дата окончания действия скидки (в часовом поясе сайта).','End date of sale price.'=>'Дата окончания действия скидки.','Endpoint for the "Checkout &rarr; Add payment method" page.'=>'Эндпоинт страницы «Оформление заказа &rarr; Добавление способа оплаты».','Endpoint for the "Checkout &rarr; Order received" page.'=>'Эндпоинт страницы «Оформление заказа &rarr; Заказ принят».','Endpoint for the "Checkout &rarr; Pay" page.'=>'Эндпоинт страницы «Оформление заказа &rarr; Оплата».','Endpoint for the "My account &rarr; Addresses" page.'=>'Эндпоинт страницы «Мой аккаунт &rarr; Адреса».','Endpoint for the "My account &rarr; Downloads" page.'=>'Эндпоинт для страницы "Мой аккаунт &rarr; Загрузки".','Endpoint for the "My account &rarr; Edit account" page.'=>'Эндпоинт для страницы "Мой аккаунт &rarr; Редактировать аккаунт".','Endpoint for the "My account &rarr; Lost password" page.'=>'Эндпоинт для страницы "Мой аккаунт &rarr; Забыли пароль".','Endpoint for the "My account &rarr; Orders" page.'=>'Эндпоинт для страницы "Мой аккаунт &rarr; Заказы".','Endpoint for the "My account &rarr; Payment methods" page.'=>'Эндпоинт для страницы "Мой аккаунт &rarr; Способы оплаты".','Endpoint for the "My account &rarr; View order" page.'=>'Эндпоинты для страницы "Мой аккаунт &rarr; Просмотреть заказ".','Endpoint for the delete payment method page.'=>'Эндпоинт для страницы удаления способа оплаты.','Endpoint for the setting a default payment method page.'=>'Эндпоинт страницы настройки способа оплаты по умолчанию.','Endpoint for the triggering logout. You can add this to your menus via a custom link: yoursite.com/?customer-logout=true'=>'Эндпоинт для срабатывания выхода. Вы можете добавить это в свои меню с помощью ссылки типа: yoursite.ru/?customer-logout=true','Endpoints are appended to your page URLs to handle specific actions during the checkout process. They should be unique.'=>'Эндпоинты добавляются к URL вашей страницы для обработки определенных действий в процессе оформления заказа. Они должны быть уникальными.','Endpoints are appended to your page URLs to handle specific actions on the accounts pages. They should be unique and can be left blank to disable the endpoint.'=>'Эндпоинты добавляются к URL страницы для обработки определённых действий на страницах аккаунтов. Они должны быть уникальными и могут быть пустым, чтобы отключить эндпоинт.','Enforce approved download directories?'=>'Принудительно применять скачивабельные директории?','Enforce Approved Product Download Directories'=>'Примените разрешенные директории для скачивания товаров','Enhance speed and security with %1$sJetpack%2$s'=>'Повысьте скорость и безопасность с %1$sJetpack%2$s','Enhance your products'=>'Улучшите свои товары','Enhance your store with extensions'=>'Используйте расширения, чтобы улучшить свой магазин.','Enhance 