a %s'=>'Я не знаю, как получить дату из %s','I have read and agree to the website %s'=>'Я прочитал(а) и принимаю %s сайта','I plan to sell both physical and digital products'=>'Я планирую продавать как физические, так и цифровые товары','I plan to sell digital products'=>'Планирую продавать цифровые товары','I plan to sell physical products'=>'Планирую продавать физические товары','I will also be selling products or services in person.'=>'Я буду также продавать товары или услуги лично.','Ialomița'=>'Яломица','Ialoveni'=>'Яловены','Iași'=>'Яссы','IBAN'=>'IBAN','Ibanda'=>'Ибанда','Ibaraki'=>'Ибараки','Ica'=>'Ика','Iceland'=>'Исландия','Icelandic kr&oacute;na'=>'Исландская крона','Icon URL for the payment method.'=>'URL значка способа оплаты.','ID'=>'ID','ID %d'=>'ID %d','ID is invalid.'=>'ID неверный.','ID of parent grouping.'=>'ID родительской группы.','ID of the note record.'=>'ID записи заметки.','ID of the original line item.'=>'ID исходной позиции.','ID of the parent product, if applicable.'=>'ID родительского товара, если есть.','ID of the refund line item. This is not the ID of the original line item.'=>'ID возврата позиции. Это не ID исходной позиции в заказе.','ID of the shipping method that provided the rate.'=>'ID способа доставки, на основе которого был рассчитан тариф.','ID of the shipping rate.'=>'ID тарифа на доставку.','ID to reassign posts to.'=>'ID, на который передается сообщение.','ID.'=>'ID.','ID: %d'=>'ID: %d','Idaho'=>'Айдахо','IDs for settings sub groups.'=>'ID для подгрупп настроек.','If a cost is defined, this controls if taxes are applied to that cost.'=>'Если стоимость определена, эта опция определяет, применяются ли налоги к той сумме.','If anything looks off or you have questions, feel free to contact our support team.'=>'Если что-то идёт не так или у вас появились вопросы, обратитесь в нашу службу поддержки.','If checked, free shipping would be available based on pre-discount order amount.'=>'Если галочка установлена, бесплатная доставка будет доступна в зависимости от суммы заказа до применения скидки.','If COD is only available for certain methods, set it up here. Leave blank to enable for all methods.'=>'Если оплата наложенным платежом доступна только для определенных способов доставки, задайте их здесь. Оставьте поле пустым, чтобы включить для всех методов.','If enabled, this method will appear on the block based checkout.'=>'Если этот метод включен, он появится в окне оформления заказа на основе блоков.','If enabled, this text will be shown site-wide. You can use it to show events or promotions to visitors!'=>'Если включено, этот текст будет отображаться на всем сайте. Его можно использовать, чтобы информировать посетителей о мероприятиях или специальных предложениях!','If managing stock, this controls if backorders are allowed.'=>'Если включено управление запасами, эта опция разрешает приём предзаказов.','If managing stock, this controls whether or not backorders are allowed. If enabled, stock quantity can go below 0.'=>'При управлении наличием этот параметр определяет, разрешены ли предзаказы. Если этот параметр включен, счётчик складских запасов может принимать значения меньше 0.','If requested, calculates attribute term counts for products in the collection.'=>'По запросу вычисляет количество значений атрибутов товаров в коллекции.','If requested, calculates taxonomy term counts for products in the collection.'=>'По запросу вычисляет количество терминов таксономии для товаров в коллекции.','If the "Delete all content" option is selected, the affected WooCommerce webhooks will <b>not</b> be deleted and will be attributed to user id 0.<br/>'=>'Если выбрана опция «Удалить всё содержимое», соответствующие веб-перехватчики WooCommerce <b>не</b> удаляются и будут приписаны к ID пользователя 0.<br/>','If the "Force Downloads" or "X-Accel-Redirect/X-Sendfile" download method is selected but does not work, the system will use the "Redirect" method as a last resort. <a href="%1$s">See this guide</a> for more details.'=>'Если выбрано принудительное скачивание или «X-Accel-Redirect/X-Sendfile», но оно не работает, система будет использовать метод переадресации в крайнем случае. Смотрите <a href="%1$s">руководство</a> для получения подробной информации.','If the payment was refunded via the API.'=>'Если уплаченные средства были возмещены через API.','If the product is downloadable.'=>'Если товар скачиваемый.','If the product is virtual.'=>'Если товар виртуальный.','If the quantity is editable or fixed.'=>'При редактируемом или фиксированном значении.','If the variation is downloadable.'=>'Если вариация скачиваемая.','If the variation is virtual.'=>'Если вариация виртуальная.','If the variation is visible.'=>'Если вариация видимая.','If this attribute has term archive pages.'=>'Если у этого атрибута есть архивные страницы значений.','If this is a default attribute'=>'Если это атрибут по умолчанию','If true and if the free shipping method requires a coupon, this coupon will enable free shipping.'=>'Если верно и для бесплатной доставки требуется купон, этот купон даст покупателю право на бесплатную доставку.','If true, calculates rating counts for products in the collection.'=>'Если верно, подсчитывает оценки товаров в коллекции.','If true, calculates stock counts for products in the collection.'=>'При включении, рассчитывает запасы товаров в коллекции.','If true, calculates the minimum and maximum product prices for the collection.'=>'Если верно, возвращает минимальные и максимальные цены товаров в коллекции.','If true, empty terms will not be returned.'=>'Если включено, пустые условия не будут возвращаться.','If true, only one item of this product is allowed for purchase in a single order.'=>'Если верно, то одним заказом можно приобрести лишь одну единицу данного товара.','If true, the coupon can only be used individually. Other applied coupons will be removed from the cart.'=>'Если верно, купон применяется только отдельно от других. Остальные купоны будут удалены из корзины.','If true, the effective value is the base value from the parent product plus the defined value; if false, the defined value is the final effective value.'=>'Если значение включено, то действующее значение - это базовое значение из родительского товара плюс определённое значение; если выключено, то определённая сумма является окончательным действующим значением.','If true, the incentive dismissal will be ignored by tracking.'=>'При включении срабатывание стимула будет игнорироваться системой отслеживания.','If true, the note will be shown to customers and they will be notified. If false, the note will be for admin reference only.'=>'Если верно, заметка будет показана клиентам и им будет отправлено уведомление. Если неверно, она будет отображаться только администратору.','If true, the note will be shown to customers. If false, the note will be for admin reference only.'=>'При включении, примечание будет отображаться клиентам. Если значение выключено, будет доступно только администратору.','If true, this coupon will not be applied to items that have sale prices.'=>'Если верно, данный купон не будет применяться к товарам со скидками.','If true, this note will be attributed to the current user. If false, the note will be attributed to the system.'=>'Если верно, данное примечание будет приписано текущему пользователю. Если неверно, оно будет приписано системе.','If unchecked, customers will need to set a username during account creation.'=>'Если флажок снят, клиентам нужно будет указать имя пользователя во время создания учётной записи.','If you are modifying WooCommerce on a parent theme that you did not build personally we recommend using a child theme. See: <a href="%s" target="_blank">How to create a child theme</a>'=>'Если вы хотите оформить WooCommerce родительской темой, которую создал кто-то другой, мы рекомендуем воспользоваться дочерней темой. См. <a href="%s" target="_blank">"Как создать дочернюю тему"</a>','If you are using X-Accel-Redirect download method along with NGINX server, make sure that you have applied settings as described in <a href=\'%s\'>Digital/Downloadable Product Handling</a> guide.'=>'Если используется метод скачивания X-Accel-Redirect вместе с NGINX, настройки должны соответствовать рекомендациям руководства <a href=\'%s\'>Обращение с цифровыми/скачиваемыми товарами</a>.','If you copied over a template file to change something, then you will need to copy the new version of the template and apply your changes again.'=>'Если вы скопировали файл-шаблон, чтобы что-то изменить, вам будет нужно скопировать новую версию шаблона и снова применить изменения.','If you create an account, we will store your name, address, email and phone number, which will be used to populate the checkout for future orders.'=>'Когда вы создаёте аккаунт, мы сохраняем ваше имя, адрес, Email и телефон для автоматического заполнения формы при оформлении заказов в будущем.','If you define a "Terms" page the customer will be asked if they accept them when checking out.'=>'Если на сайте определена страница "Условий", то клиент должен будет принять их перед оплатой заказа.','If you didn\'t make this request, just ignore this email. If you\'d like to proceed:'=>'Если вы не отправляли этот запрос, просто проигнорируйте это сообщение. Если хотите продолжить:','If you didn’t make this request, just ignore this email. If you’d like to proceed, reset your password via the link below:'=>'Если вы не отправляли этого запроса, просто не обращайте внимания на это письмо. Если вы хотите продолжить, сбросьте пароль, перейдя по ссылке ниже.','If you don\'t have an application password (not your account password), generate a password from %s'=>'Если у вас нет пароля для приложения (это не пароль для вашей учётной записи), создайте его в %s','If you find a bug within WooCommerce core you can create a ticket via <a href="%1$s">GitHub issues</a>. Ensure you read the <a href="%2$s">contribution guide</a> prior to submitting your report. To help us solve your issue, please be as descriptive as possible and include your <a href="%3$s">system status report</a>.'=>'При обнаружении неполадок в ядре WooCommerce можно оформить заявку через <a href="%1$s">GitHub Issues</a>. Обязательно прочитайте <a href="%2$s">руководство контрибутора</a>, прежде чем отправлять отчет. Чтобы мы могли быстрее решить проблему, опишите ее как можно подробнее и приложите <a href="%3$s">отчёт о состоянии системы</a>.','If you have any questions or notice anything unexpected, feel free to reach out to our support team through your account or reply to this email.'=>'Если у вас есть вопросы или вы заметили что-либо неожиданное, обращайтесь в нашу службу поддержки через свою учётную запись или ответьте на это письмо.','If you have shopped with us before, please enter your details below. If you are a new customer, please proceed to the Billing section.'=>'Если вы уже оформляли заказ на нашем сайте, пожалуйста, введите свои данные ниже. Если вы являетесь новым клиентом, пожалуйста, заполните платёжные данные в соответствующем разделе.','If you like %1$s please leave us a %2$s rating. A huge thanks in advance!'=>'Если вам нравится %1$s, поставьте нам оценку %2$s. Заранее спасибо!','If you like, you may enter custom structures for your product URLs here. For example, using <code>shop</code> would make your product links like <code>%sshop/sample-product/</code>. This setting affects product URLs only, not things such as product categories.'=>'При необходимости здесь можно настроить структуру URL-адресов ваших товаров. Например, если использовать <code>shop</code> (магазин), то ваши ссылки на товары будут выглядеть так: <code>%sshop/sample-product/</code>. Такая настройка относится только к URL-адресам товаров. Она не влияет на другие данные, например на категории товаров.','If you need any help with your order, please contact us at %s'=>'Свяжитесь с нами по адресу %s, если вам нужна помощь с оформлением заказа','If you need any help with your order, please contact us at %s.'=>'Свяжитесь с нами по адресу %s, если вам нужна помощь с оформлением заказа.','If you need any help with your order, please contact us at {store_email}.'=>'Свяжитесь с нами по адресу {store_email}, если вам нужна помощь с оформлением заказа.','If you need to access the setup wizard again, please click on the button below.'=>'Если вы хотите снова получить доступ к помощнику установки, кликните по кнопке ниже.','If you need to enable or disable the extended task lists, please click on the button below.'=>'Если вам нужно снова включить или выключить расширенные списки задач, нажмите кнопку ниже.','If you need to enable or disable the task lists, please click on the button below.'=>'Если вам нужно включить или отключить список задач, нажмите на кнопку ниже.','If you remove this attribute, customers will no longer be able to purchase some variations of this product.'=>'Если удалить этот атрибут, клиенты больше не смогут приобретать некоторые вариации данного товара.','If you\'d like to continue with your purchase, please return to %s and try a different method of payment.'=>'Если хотите продолжить покупку, вернитесь к %s и попробуйте применить другой способ оплаты.','If you\'d like to offer <span class="help_tip" data-tip="%1$s">live rates</span> from a specific carrier (e.g. UPS) you can find a variety of extensions available for WooCommerce <a href="%2$s" target="_blank">here</a>.'=>'Если вы хотите предложить <span class="help_tip" data-tip="%1$s">текущие тарифы</span> от конкретной транспортной компании (например, UPS), доступные расширения для WooCommerce см. <a href="%2$s" target="_blank">здесь</a>.','If you\'ve just placed an order, give your email a quick check for the confirmation.'=>'Если вы только что разместили заказ, проверьте свой электронный почтовый ящик для его подтверждения.','If your main PayPal email differs from the PayPal email entered above, input your main receiver email for your PayPal account here. This is used to validate IPN requests.'=>'Если ваш основной email PayPal отличается от введенного выше, то введите ваш основной получатель email здесь. Используется для подтверждения запросов IPN.','If your store is based in the EU, we recommend using the EU VAT Number extension in addition to automated taxes. It provides your checkout with a field to collect and validate a customer\'s EU VAT number, if they have one.'=>'Если ваш магазин находится на территории ЕС, рекомендуем помимо автоматических налогов использовать расширение "Номер плательщика НДС (ЕС)". Благодаря нему на странице оформления заказа появляется поле, которое позволяет собирать и проверять номер плательщика НДС в ЕС, если такой есть у клиента.','Ifrane'=>'Ифран','IFSC'=>'IFSC код','Ifugao'=>'Ифугао','Iganga'=>'Иганга','Ilaam (ایلام)'=>'Илам','Ilfov'=>'Илфов','Illinois'=>'Иллинойс','Illizi'=>'Иллизи','Ilocos Norte'=>'Северный Илокос','Ilocos Sur'=>'Южный Илокос','Iloilo'=>'Илоило','Image'=>'Картинка','Image alternative text.'=>'Альтернативный текст изображения.','Image data.'=>'Данные изображения.','Image ID.'=>'ID изображения.','Image name.'=>'Название изображения.','Image of the product that the review belongs to.'=>'Изображение товара, к которому относится отзыв.','Image position. 0 means that the image is featured.'=>'Положение изображения. 0 означает, что используется рекомендуемое изображение.','Image size used for products in the catalog.'=>'Размер изображений товаров в каталоге.','Image size used for the main image on single product pages. These images will remain uncropped.'=>'Размер основного изображения на страницах товаров. Эти изображения не будут обрезаны.','Image url'=>'URL изображения','Image URL.'=>'URL изображения.','Images'=>'Изображения','Images will be cropped into a square'=>'Изображения будут обрезаны в виде квадрата','Images will be cropped to a custom aspect ratio'=>'Изображения будут обрезаны до указанных пропорций','Images will display using the aspect ratio in which they were uploaded