ion you should list which third party payment processors you’re using to take payments on your store since these may handle customer data. We’ve included PayPal as an example, but you should remove this if you’re not using PayPal.'=>'В этом разделе вам необходимо указать, услугами каких сторонних платёжных сервисов вы пользуетесь для приёма платежей в своем магазине, так как эти сервисы могут обрабатывать данные покупателей. Мы привели сведения об использовании PayPal в качестве примера. Если вы не пользуетесь услугами PayPal, этот текст необходимо удалить.','In-progress'=>'В процессе','In-Progress <span class="count">(%s)</span>'=>'Выполняется <span class="count">(%s)</span>' . "\0" . 'Выполняется <span class="count">(%s)</span>' . "\0" . 'Выполняется <span class="count">(%s)</span>','Inactive'=>'Неактивно','Inactive accounts are those which have not logged in, or placed an order, for the specified duration. They will be deleted. Any orders will be converted into guest orders.'=>'Неактивные аккаунты — это те, в которые пользователь не заходил или из которых не делал заказов в течение определённого времени. Они будут удалены. А их заказы будут преобразованы в гостевые.','Inactive plugins'=>'Неактивные плагины','Inactive plugins.'=>'Неактивные плагины.','Inbox notification has been deleted'=>'Уведомление удалено','Inbox notification not found'=>'Уведомление не найдено','Inches'=>'Дюймы','Include downloads'=>'Включить скачивание','Includes all settings in WooCommerce | Settings | Account and Privacy.'=>'Включает все настройки раздела WooCommerce > Настройки > Аккаунты и приватность.','Includes all settings in WooCommerce | Settings | Advanced.'=>'Включает все настройки раздела WooCommerce > Настройки > Дополнительно.','Includes all settings in WooCommerce | Settings | Emails.'=>'Включает все настройки раздела WooCommerce > Настройки > Почта.','Includes all settings in WooCommerce | Settings | General.'=>'Включает все настройки раздела WooCommerce > Настройки > Основны