>'Ограничить результат объектами с последним заказом не позднее заданных даты и времени в формате ISO8601.','Limit response to objects with specific countries.'=>'Ограничить результат определёнными странами.','Limit response to objects with specific names.'=>'Ограничить результат определённые именами.','Limit response to objects with specific usernames.'=>'Ограничить результат определённые именами пользователей.','Limit response to resources created after a given ISO8601 compliant date.'=>'Ограничить ответ отзывами, опубликованными после заданной ISO8601 совместимой даты.','Limit response to resources created before a given ISO8601 compliant date.'=>'Ограничить ответ для ресурсов, опубликованных до указанной даты в совместимом с ISO 8601 формате.','Limit response to resources modified after a given ISO8601 compliant date.'=>'Ограничить ответ на ресурсы, измененные после указанной даты в стандарте ISO8601.','Limit response to resources modified before a given ISO8601 compliant date.'=>'Ограничить ответ на ресурсы, измененные до указанной даты в стандарте ISO8601.','Limit response to resources published after a given ISO8601 compliant date.'=>'Ограничить ответ на ресурсы, опубликованные после указанной даты, в формате, совместимом с ISO 8601.','Limit response to resources published before a given ISO8601 compliant date.'=>'Ограничить ответ на ресурсы, опубликованные до указанной даты, в формате, совместимом с ISO 8601.','Limit response to reviews published before a given ISO8601 compliant date.'=>'Ограничить ответ отзывами, опубликованными до заданной ISO8601 совместимой даты.','Limit response to specific fields. Defaults to all fields.'=>'Ограничить ответ специфическими полями. По умолчанию - все поля.','Limit response to specific report stats. Allowed values: %s.'=>'Ограничить результат конкретными статистическими данными. Допустимые значения: %s.','Limit result set to all items except those of a particular parent ID.'=>'Фильтрация объектов, исключающая назначенные 