ption name | Additional cost [+- Percents] | Per cost type (order, class, or item) Example: <code>Priority mail | 6.95 [+ 0.2%] | order</code>.'=>'Один на строку: Название опции | Наценка [+– Проценты%] | На вид издержек (заказ, класс или элемент) Пример: <code>Срочное почтовое отправление | 6,95 [+ 0,2%] | заказ</code>.','One review'=>'Один отзыв','One review for %s'=>'Один отзыв на %s','Online courses are a great solution for any business that can teach a new skill. Since courses don’t require physical product development or shipping, they’re affordable, fast to create, and can generate passive income for years to come. In this article, we provide you more information about selling courses using WooCommerce.'=>'Онлайн-курсы — отличное решение для любого бизнеса, который помогает приобретать навыки. Курсы не требуют разработки физических продуктов и не нуждаются в доставке. Они быстро создаются, легки в обслуживании и могут приносить пассивный доход долгие годы. В этой статье мы подробно расскажем о том, как продавать курсы с помощью WooCommerce.','Only %s left in stock'=>'В наличии лишь %s','Only available when HPOS is authoritative and compatibility mode is disabled.'=>'Доступно только в случае, если HPOS является надёжным и режим совместимости отключён.','Only logged in customers who have purchased this product may leave a review.'=>'Только зарегистрированные клиенты, купившие данный товар, могут публиковать отзывы.','Only shipping'=>'Только доставка','Only show children of the current category'=>'Показывать только дочерние элементы категории','Only show meta which is meant to be displayed for an order.'=>'Показывайте только те метаданные, которые связаны с заказом.','Only show quantity remaining in stock when low e.g. "Only 2 left in stock"'=>'Показывать, сколько единиц товара в наличии, только если осталось мало, например: «В наличии лишь 2»','Ontario'=>'Онтарио','Open downloadable files in the browser, instead of saving them to the device.'=>'Открывать скачив