rms.'=>'При необходимости, добавьте текст политики конфиденциальности своего магазина. Этот текст будет отображаться в форме регистрации аккаунта.','Optionally add some text for the terms checkbox that customers must accept.'=>'При необходимости добавьте текст, который клиенты должны принять, поставив галочку.','Optionally control which tax class shipping gets, or leave it so shipping tax is based on the cart items themselves.'=>'Определяет какой налоговый класс используется для доставки. Оставьте пустым для использования индивидуальных ставок для каждого товара в корзине.','Optionally enable "Payment Data Transfer" (Profile > Profile and Settings > My Selling Tools > Website Preferences) and then copy your identity token here. This will allow payments to be verified without the need for PayPal IPN.'=>'Опционально можно включить "Передачу данных об оплате" (Профиль > Профиль и настройки > Мои инструменты продаж > Установки сайта) и вставить идентификационный маркер сюда. Это позволит подтверждать платежи без использования PayPal IPN.','Optionally enter the URL to a 150x50px image displayed as your logo in the upper left corner of the PayPal checkout pages.'=>'Опционально введите URL изображения с разрешением 150x50px, которое будет отображаться как ваш логотип в верхнем левом углу страниц оплаты PayPal.','Optionally, how the metadata value should be displayed to the user.'=>'Опционально, как значение метаданных должно отображаться пользователю.','Options'=>'Настройки','OR'=>'ИЛИ','OR enter path to file:'=>'ИЛИ укажите путь к файлу:','Or you can download a pre-built version of the plugin from the <a href="%1$s">WordPress.org repository</a> or by visiting <a href="%2$s">the releases page in the GitHub repository</a>.'=>'Либо вы можете скачать уже собранную версию плагина из <a href="%1$s">репозитория WordPress.org</a> или со <a href="%2$s"> страницы релизов в репозитории GitHub</a>.','Or, enter tax rate ID:'=>'Или укажите ID налоговой ставки:','Oran'=>'Оран','Order'=>