ссылке, отправленной на ваш электронный адрес.','Thanks for signing up! Please complete the sign-up process by following the verification link sent to your e-mail.'=>'Спасибо за регистрацию! Завершите процесс регистрации, перейдя по ссылке, отправленной на ваш электронный адрес.','Thanks for using Jetpack! Your store is almost ready: to activate services like %s, just connect your store.'=>'Спасибо, что используете Jetpack! Ваш магазин почти готов: чтобы активировать службы, такие как %s, просто подключите свой магазин.','Thanks for using {site_url}!'=>'Мы рады, что вы используете {site_url}!','Thanks for your order. It’s on-hold until we confirm that payment has been received.'=>'Спасибо за ваш заказ. Он находится в режиме ожидания до тех пор, пока не будет получено подтверждение получения платёжа.','Thanks!'=>'Спасибо!','Tharaka-Nithi'=>'Тарака-Нити','the'=>' ','The "%1$s" coupon has been removed from your cart: %2$s'=>'Купон "%1$s" удален из вашей корзины: %2$s','The "locations not covered by your other zones" zone cannot be updated.'=>'Зону "расположения, не включённые в другие ваши зоны" нельзя изменить.','The "WooCommerce Admin" plugin will be installed and activated'=>'Будет установлен и активирован плагин «Администратор WooCommerce»','The %1$s plugin has been deactivated as the latest improvements are now included with the %2$s plugin.'=>'Плагин %1$s деактивирован, так как последние улучшения теперь включены в плагин %2$s.','The %1$sApproved Product Download Directories list%2$s has been updated. To protect your site, please review the list and make any changes that might be required. For more information, please refer to %3$sthis guide%2$s.'=>'Список %1$sСкачивабельных директорий товаров%2$s обновлён. Чтобы защитить свой сайт, просмотрите список и внесите в него необходимые изменения. Подробности в %3$sэтом руководстве%2$s.','The %s cannot be deleted.'=>'%s не может быть удалено.','The %s class can only be run within WP CLI.'=>'Класс %s может быть запущен только в WP CLI.','The %s does not support trashing.'=>'%s невозможно удалять в мусорку.','The %s extension is not active.'=>'Расширение %s не активно.','The %s extension is not up-to-date. Please update to the latest version and try again.'=>'Расширение %s не обновлено. Обновите его до последней версии и попробуйте снова.','The %s has already been deleted.'=>'%s уже удалили до этого.','The %s hook has a filter set, so some log files may have different retention settings.'=>'Хук действия %s пользуется набором фильтров, поэтому некоторые файлы журналов могут иметь разные настройки хранения.','The %s is not a valid URL'=>'%s не является валидным URL','The %s payment gateway is not available.'=>'Платежный шлюз %s недоступен.','The action type to determine how to use the URL.'=>'Тип действия, определяющий применение URL-адреса.','The action\'s schedule frequency.'=>'Периодичность выполнения действия.','The active incentive for the provider.'=>'Активный стимул для поставщика.','The active version of WooCommerce does not support template cache clearing.'=>'Активная версия WooCommerce не поддерживает очистку кэша шаблона.','The Add to Cart + Options templates allow defining a different layout for each product type.'=>'Шаблоны добавления товаров в корзину с опциями позволяют настраивать разметку для каждого типа товара.','The admin note action label prop cannot be empty.'=>'Метка действия заметки администратора не может быть пустой.','The admin note action name prop cannot be empty.'=>'Название действия заметки администратора не может быть пустым.','The admin note content prop cannot be empty.'=>'Содержимое заметки администратора не может быть пустым.','The admin note content_data prop must be an instance of stdClass.'=>'Примечание администратора должно содержать экземпляр stdClass.','The admin note date prop cannot be empty.'=>'Дата заметки администратора не могут быть пустой.','The admin note layout has a wrong prop value.'=>'Макет примечания администратора включает неверное значение свойства.','The admin note locale prop cannot be empty.'=>'Язык заметки администратора не может быть пустым.','The admin note name prop cannot be empty.'=>'Название заметки администратора не может быть пустым.','The admin note source prop cannot be empty.'=>'Источник заметки администратора не может быть пустым.','The admin note status prop (%s) is not one of the supported statuses.'=>'Состояние заметки администратора (%s) не является одним из поддерживаемых состояний.','The admin note status prop cannot be empty.'=>'Статус заметки администратора не может быть пустым.','The admin note title prop cannot be empty.'=>'Заголовок заметки администратора не может быть пустым.','The admin note type prop (%s) is not one of the supported types.'=>'Тип примечания администратора (%s) не является одним из поддерживаемых типов.','The admin note type prop cannot be empty.'=>'Тип заметки администратора не может быть пустым.','The admin note type prop is deprecated.'=>'Тип примечания администратора устарел.','The affected WooCommerce webhooks will <b>not</b> be deleted and will be attributed to user id 0.<br/>'=>'Соответствующие веб-перехватчики WooCommerce <b>не</b> удаляются и будут приписаны к ID пользователя 0.<br/>','The amount of discount. Should always be numeric, even if setting a percentage.'=>'Сумма скидки. Всегда в числовом формате, даже если представляет собой процент.','The amount of tax charged.'=>'Сумма налога.','The amount of time (in seconds) that your site will spend on a single operation before timing out (to avoid server lockups)'=>'Количество времени (в секундах), которое ваш сайт будет тратить на отдельную операцию до истечения срока (для избежания зависаний сервера).','The amount that quantities increment by. Quantity must be an multiple of this value.'=>'Число, на которое увеличивается количество. Количество будет кратно этому значению.','The API key provided does not have read permissions.'=>'Предоставленный ключ API не имеет прав на чтение.','The API key provided does not have write permissions.'=>'Предоставленный ключ API не имеет прав на запись.','The Approved Product Download Directories list is currently being synchronized with the product catalog (%d%% complete). If you need to, you can cancel it.'=>'Список разрешенных директорий для скачивания товаров синхронизируется с каталогом товаров (выполнено %d%%). При необходимости вы можете отменить этот процесс.','The assigned attribute.'=>'Назначенный атрибут.','The attribute ID, or 0 if the attribute is not taxonomy based.'=>'ID атрибута или 0, если атрибут не основан на таксономии.','The attribute name.'=>'Название атрибута.','The attribute taxonomy name.'=>'Название таксономии атрибута.','The attribute taxonomy, or null if the attribute is not taxonomy based.'=>'Таксономия атрибута или «null», если атрибут не основан на таксономии.','The available actions for the step.'=>'Доступные действия на этапе.','The backup datastore does not support updating orders.'=>'Резервное хранилище данных не поддерживает обновление заказов.','The badge label for the incentive.'=>'Ярлык значка стимула.','The base page can also be used in your <a href="%s">product permalinks</a>.'=>'Эта основная страница также может использоваться для <a href="%s">постоянных ссылок на товар</a>.','The bearer token that ChatGPT uses to authenticate checkout requests.'=>'Токен на предъявителя, который ChatGPT использует для проверки подлинности запросов на оформление заказа.','The call to action label for the incentive.'=>'Ярлык призыва к действию стимула.','The callback_url needs to be over SSL'=>'callback_url должен передаваться по SSL','The cart has been filled with the items from your previous order.'=>'Корзина была наполнена товарами из вашего предыдущего заказа.','The cart item product or variation ID.'=>'ID товара или вариации в корзине.','The Cart template displays the items selected by the user for purchase, including quantities, prices, and discounts. It allows users to review their choices before proceeding to checkout.'=>'В шаблоне корзины отображаются товары, выбранные пользователем для покупки, включая количество, цены и скидки. Это позволяет пользователям ознакомиться со своим выбором, прежде чем приступить к оформлению заказа.','The category of the suggestion.'=>'Рубрика предложения.','The changes you made will be lost if you navigate away from this page.'=>'Изменения которые вы сделали будут потеряны если вы уйдете с этой страницы.','The checkout session ID (Cart-Token JWT).'=>'ID сеанса оформления заказа (JWT-токен корзины).','The Checkout template guides users through the final steps of the purchase process. It enables users to enter shipping and billing information, select a payment method, and review order details.'=>'Шаблон оформления покупки помогает пользователям пройти последние шаги процесса покупки. Он позволяет пользователям ввести информацию о доставке и оплате, выбрать способ оплаты и просмотреть детали заказа.','The chosen rate ID for the package.'=>'ID выбранного для пакета тарифа.','The city in which your business is located.'=>'Город, в котором расположен ваш магазин.','The claim has been lost. Aborting current batch.'=>'Заявка потеряна. Принудительное прерывание текущего пакета.','The class %1$s provided by %2$s filter must implement %3$s.'=>'Класс %1$s предоставленный фильтром %2$s может реализовать %3$s.','The class attached to the "woocommerce_queue_class" does not implement the WC_Queue_Interface interface. The default %s class will be used instead.'=>'Класс, присоединённый к «woocommerce_queue_class», не реализует интерфейс WC_Queue_Interface. Вместо него будет использоваться класс %s по умолчанию.','The comment has already been trashed.'=>'Комментарий уже удалён в мусорку.','The comparison operator to use for total filtering.'=>'Оператор сравнения, используемый для полной фильтрации.','The content of the review.'=>'Содержание отзыва.','The context ID for which to dismiss the incentive. If not provided, will dismiss the incentive for all contexts.'=>'Идентификатор контекста, в котором следует скрывать стимул. Если не указано, стимул будет скрыт во всех контекстах.','The Core Profiler step to mark as complete.'=>'Действие в основном профилировщике, которое требуется отметить как выполненное.','The corresponding plugin details of the provider.'=>'Сведения о поставщике плагина.','The country and state or province, if any, in which your business is located.'=>'Страна и область/край/республика, если есть, где расположен ваш магазин.','The coupon code already exists'=>'Код купона уже существует','The coupon code cannot be empty.'=>'Код купона не может быть пустым.','The coupon will expire at 00:00:00 of this date.'=>'Купон перестанет действовать в 00:00:00 в этот день.','The coupon\'s unique code.'=>'Уникальный код купона.','The coupons unique code.'=>'Уникальный код купонов.','The CSV is invalid.'=>'Этот CSV имеет неправильный формат.','The current language used by WordPress. Default = English'=>'Используемый язык WordPress\'а. По умолчанию = Английский','The current status of the step.'=>'Текущий статус этапа.','The custom cost of goods sold values will revert back to their defaults for all the variations. Would you like to continue?'=>'Пользовательская стоимость проданных товаров будет восстановлена до значений по умолчанию для всех вариантов. Вы действительно хотите продолжить?','The customer’s payment failed or was declined, and no payment has been successfully made.'=>'Платёж клиента был прерван или отклонён, и оплата не была произведена.','The database update process runs in the background and may take a little while, so please be patient. Advanced users can alternatively update via %1$sWP CLI%2$s.'=>'Процесс обновления базы данных в фоновом режиме может занять некоторое время, пожалуйста, подождите. Продвинутые пользователи могут обновить базу, используя %1$sWP CLI%2$s.','The database version for WooCommerce. This should be the same as your WooCommerce version.'=>'Версия базы данных WooCommerce. Она должна совпадать с версией базы данных WooCommerce.','The date of the customer last order, as GMT.'=>'Дата последнего заказа этого клиента (в формате GMT).','The date of the download, as GMT.'=>'Дата скачивания (в формате GMT).','The date of the download, in the site\'s timezone.'=>'Дата скачивания (в часовом поясе сайта).','The date the coupon expires, as GMT.'=>'Дата окончания срока действия купона (в формате GMT).','The date the coupon expires, in the site\'s timezone.'=>'Дата окончания срока действия купона (в часовом поясе сайта).','The date the coupon was created, as GMT.'=>'Дата создания купона (в формате GMT).','The date the coupon was created, in the site\'s timezone.'=>'Дата создания купона в часовом поясе сайта.','The date the coupon was last modified, as GMT.'=>'Дата последнего изменения купона (в формате GMT).','The date the coupon was last modified, in the site\'s timezone.'=>'Дата последнего изменения купона в часовом поясе сайта.','The date the customer was created, as GMT.'=>'Дата создания клиента (в формате GMT).','The date the customer was created, in the site\'s timezone.'=>'Дата создания пользователя в часовом поясе сайта.','The date the customer was last modified, as GMT.'=>'Дата последнего изменения профиля этого клиента (в формате GMT).','The date the customer was last modified, in the site\'s timezone.'=>'Дата последнего изменения пользователя в часовом поясе сайта.','The date the fulfillment was deleted.'=>'Дата удаления выполнения.','The date the fulfillment was last updated.'=>'Дата последнего обновления выполнения.','The date the image was created, as GMT.'=>'Дата создания изображения (в формате GMT).','The date the image was created, in the site\'s timezone.'=>'Дата создания изображения в часовом поясе сайта.','The date the image was last modified, as GMT.'=>'Дата последнего изменения изображения (в формате GMT).','The date the image was last modified, in the site\'s timezone.'=>'Дата последнего изменения изображения в часовом поясе сайта.','The date the last order for this product was placed, in the site\'s timezone.'=>'Дата последнего заказа этого товара в часовом поясе сайта.','The date the order note was created, as GMT.'=>'Дата создания заметки о заказе (в формате GMT).','The date the order note was created, in the site\'s timezone.'=>'Дата создания заметки к заказу в часовом поясе сайта.','The date the order refund was created, as GMT.'=>'Дата возврата средств по заказу (в формате GMT).','The date the order refund was created, in the site\'s timezone.'=>'Дата инициирования возврата заказа в часовом поясе сайта.','The date the order was completed, as GMT.'=>'Дата завершения заказа (в формате GMT).','The date the order was completed, in the site\'s timezone.'=>'Дата завершения заказа в часовом поясе сайта.','The date the order was created, as GMT.'=>'Дата создания заказа (в формате GMT).','The date the order was created, in the site\'s timezone.'=>'Дата создания заказа в часовом поясе сайта.','The date the order was last modified, as GMT.'=>'Дата последнего изменения заказа (в формате GMT).','The date the order was last modified, in the site\'s timezone.'=>'Дата последнего изменения заказа в часовом поясе сайта.','The date the order was paid, as GMT.'=>'Дата оплаты заказа (по часовому поясу GMT).','The date the order was paid, in the site\'s timezone.'=>'Дата оплаты заказа в часовом поясе сайта.','The date the product was created, as GMT.'=>'Дата создания товара (в формате GMT).','The date the product was created, in the site\'s timezone.'=>'Дата создания товара в часовом поясе сайта.','The date the product was last modified, as GMT.'=>'Дата последнего изменения товара (в формате GMT).','The date the product was last modified, in the site\'s timezone.'=>'Дата последнего изменения товара в часовом поясе сайта.','The date the refund was created, as GMT.'=>'Дата осуществления возврата средств (GMT).','The date the refund was created, in the site\'s timezone.'=>'Дата возврата средств, в часовом поясе сайта.','The date the report end, as GMT.'=>'Дата завершения формирования отчёта (в формате GMT).','The date the report end, in the site\'s timezone.'=>'Дата окончания отчёта (в часовом поясе сайта).','The date the report start, as GMT.'=>'Дата начала формирования отчёта (в формате GMT).','The date the report start, in the site\'s timezone.'=>'Дата начала отчёта (в часовом поясе сайта).','The date the review was created, as GMT.'=>'Дата создания рецензии (в формате GMT).','The date the review was created, in the site\'s timezone in human-readable format.'=>'Дата создания отзыва в часовом поясе сайта и в удобочитаемом формате.','The date the review was created, in the site\'s timezone.'=>'Дата создания отзыва в часовом поясе сайта.','The date the variation was created, in the site\'s timezone.'=>'Дата создания вариации (в часовом поясе сайта).','The date the variation was last modified, in the site\'s timezone.'=>'Дата последнего изменения вариации (в часовом поясе сайта).','The date the webhook delivery was logged, as GMT.'=>'Дата регистрации доставки вебзацепа (в формате GMT).','The date the webhook delivery was logged, in the site\'s timezone.'=>'Дата доставки вебзацепа, зафиксированная в часовом поясе сайта.','The date the webhook was created, as GMT.'=>'Дата создания вебзацепа (в формате GMT).','The date the webhook was created, in the site\'s timezone.'=>'Дата создания вебзацепа в часовом поясе сайта.','The date the webhook was last modified, as GMT.'=>'Дата последнего изменения вебзацепа (в формате GMT).','The date the webhook was last modified, in the site\'s timezone.'=>'Дата последнего изменения вебзацепа в часовом поясе сайта.','The date when download access expires, as GMT.'=>'Дата окончания срока действия ссылки на скачивания (в формате GMT).','The date when download access expires, in the site\'s timezone.'=>'Дата, когда доступ к скачиванию будет закрыт, в часовом поясе сайта.','The date you provided is invalid.'=>'Предоставленная дата неверна.','The date/time the action is/was scheduled to run.'=>'Дата/время, когда было запланировано выполнение этого действия.','The decimal separator of displayed prices.'=>'Десятичный разделитель цен.','The default timezone for your server.'=>'Временная зона по умолчанию для вашего сервера.','The delivery duration, in seconds.'=>'Длительность доставки в секундах.','The description of the category.'=>'Описание рубрики.','The description of the payment method. It can contain basic HTML.'=>'Описание способа оплаты. Может содержать базовую HTML-разметку.','The description of the provider.'=>'Описание поставщика.','The description of the suggestion.'=>'Описание предложения.','The details for a recommended payment method.'=>'Подробные сведения о рекомендованном способе оплаты.','The discount type for the coupon (e.g. percentage or fixed amount)'=>'Тип скидки по купону (в процентах или фиксированная величина)','The dismissals list for the incentive. Each dismissal entry includes a context and a timestamp. The `all` entry means the incentive was dismissed for all contexts.'=>'Список отклонённых стимулов. Каждая запись об отклонении включает контекст и временную метку. Запись «все» означает, что стимул был отклонён во всех контекстах.','The display name of the email template.'=>'Отображаемое имя шаблона письма.','The downloadable file %1$s cannot be used as it does not have an allowed file type. Allowed types include: %2$s'=>'Скачиваемый файл %1$s не может быть использован, так как его формат не входит в список допустимых. Допустимые форматы файлов: %2$s','The downloadable file %s cannot be used as it does not exist on the server, or is not located within an approved directory. Please contact a site administrator for help. %2$sLearn more.%3$s'=>'Скачиваемый файл %s невозможно использовать, поскольку он отсутствует на сервере или находится в недоступном каталоге. Обратитесь за помощью к администратору сайта. %2$sУзнать подробности%3$s.','The downloadable file %s cannot be used as it has been disabled.'=>'Невозможно использовать скачиваемый файл %s, поскольку он деактивирован.','The email address for the customer.'=>'Email для пользователя.','The email address provided does not match the email address on this order.'=>'Указанный адрес эл. почты не совпадает с адресом эл. почты в заказе.','The email ID to recreate the post for.'=>'ID письма для повторного создания записи.','The email type to get subject for.'=>'Тип эл. письма, которому требуется тема.','The email type to preview.'=>'Тип сообщения электронной почты для предварительного просмотра.','The entity ID is required.'=>'Требуется ID объекта.','The entity type must be "order".'=>'Объекта должен относиться к типу «заказ».','The Eway extension for WooCommerce allows you to take credit card payments directly on your store without redirecting your customers to a third party site to make payment.'=>'Расширение Eway для WooCommerce позволяет принимать платежи по банковской карте прямо в магазине, без перенаправления клиентов на сторонний сайт для оплаты.','The eWAY extension for WooCommerce allows you to take credit card payments directly on your store without redirecting your customers to a third party site to make payment.'=>'Расширение eWAY для WooCommerce позволяет принимать платежи по банковской карте прямо в вашем магазине, без перенаправления клиентов на сторонний сайт для оплаты.','The extension %s has been deactivated successfully.'=>'Расширение %s деактивировано.','The field %1$s is invalid for the location %2$s.'=>'Содержимое поля %1$s недопустимо для местоположения %2$s.','The field %s is invalid.'=>'Содержимое поля %s недопустимо.','The field %s is required.'=>'Поле %s является обязательным для заполнения.','The file does not exist, please try again.'=>'Этот файл не существует, пожалуйста, попробуйте еще раз.','The file is empty or using a different encoding than UTF-8, please try again with a new file.'=>'Файл пуст, или использует иную кодировку, нежели UTF-8, попробуйте ещё раз.','The following active plugin(s) have not declared compatibility with WooCommerce %s yet and should be updated and examined further before you proceed:'=>'Следующие активные плагины пока не объявляют совместимость с версией WooCommerce %s и должны быть обновлены или проверены перед тем как вы продолжите:','The following addresses will be used on the checkout page by default.'=>'Следующие адреса будут использованы по умолчанию при оформлении заказов.','The following note has been added to your order:'=>'К заказу добавлено примечание:','The following options affect how prices are displayed on the frontend.'=>'Следующие параметры влияют на то, как отображаются цены во фронтэнде.','The following plugins will be installed and activated for you:'=>'Будут установлены и активированы следующие плагины:','The following problems were found:'=>'Были обнаружены следующие проблемы:','The following wizard will help you configure your store and get you started quickly.'=>'Следующий мастер поможет вам быстро настроить и запустить ваш магазин.','The font face family name is required.'=>'Необходимо указать имя семейства начертания шрифта.','The font face font style is required.'=>'Необходимо указать стиль начертания шрифта.','The font face src is required.'=>'Необходимо указать опцию src начертания шрифта.','The font face weight is required.'=>'Необходимо указать толщину начертания шрифта.','The font family name is required.'=>'Необходимо указать имя семейства шрифтов.','The font family preview is required.'=>'Необходимо указать изображение для предварительного просмотра семейства шрифтов.','The fulfillment items should be an array.'=>'Позиции в выполнении должны быть массивом.','The fulfillment should contain at least one item.'=>'Выполнение должно содержать хотя бы одну позицию.','The fulfillment status of the order.'=>'Статус обработки заказа.','The general state of the onboarding process.'=>'Общий статус процесса регистрации.','The general state of the provider with regards to it\'s payments processing.'=>'Общий статус поставщика относительно обработки платежей.','The group "%s" does not exist.'=>'Группы «%s» не существует.' . "\0" . '' . "\0" . '','The group of order note.'=>'Группа примечаний к заказу.','The homepage is one of the most important entry points in your store. When done right it can lead to higher conversions and engagement. Don\'t forget to personalize the homepage that we created for your store during the onboarding.'=>'Страница обзора — один из самых важных разделов вашего магазина. Правильная настройка может помочь повысить конверсию и интерес посетителей. Не забывайте о возможности редактировать страницу, которую мы создали для вашего магазина в процессе адаптации.','The homepage URL of your site.'=>'URL главной страницы вашего сайта.','The HTTP response code from the receiving server.'=>'Код ответа HTTP от принимающего сервера.','The HTTP response message from the receiving server.'=>'Ответное сообщение HTTP от принимающего сервера.','The ID for the parent of the resource.'=>'ID родителя данного ресурса.','The ID for the resource.'=>'ID ресурса.','The id for the resource.'=>'ID для ресурса.','The ID of the order that was refunded.'=>'ID возвращённого заказа.','The ID of the package being shipped. Leave blank to apply to all packages.'=>'ID отправляемого пакета. Оставьте поле пустым, чтобы применить ко всем.','The ID of the package the shipping rates belong to.'=>'ID пакета, к которому относятся тарифы доставки.','The ID of the payment method being used to process the payment.'=>'ID способа оплаты, используемого для обработки платежа.','The ID of the template to use for sending the email.'=>'Идентификатор шаблона для отправки письма.','The image of the note, if any.'=>'Изображение, если есть.','The image upload failed: "%s", creating the product without image'=>'Не удалось загрузить изображение: «%s», создание товара без изображения','The incentive description. It can contain stylistic HTML.'=>'Описание стимула. Может содержать стилистическую HTML-разметку.','The incentive promo ID. This ID need to be fed into the onboarding flow.'=>'Идентификатор промостимула. Этот идентификатор требуется ввести в процессе регистрации.','The incentive title. It can contain stylistic HTML.'=>'Заголовок стимула. Может содержать стилистическую HTML-разметку.','The incentive unique ID. This ID needs to be used for incentive dismissals.'=>'Уникальный идентификатор стимула. Этот идентификатор применяется для скрытия стимула.','The indicated downloads have been disabled (invalid location or filetype&mdash;%1$slearn more%2$s).'=>'Указанные скачивания деактивированы (недопустимые расположение или тип файла — %1$sподробнее%2$s).','The installed version of the current active theme.'=>'Версия активной темы сайта.','The installed version of the parent theme.'=>'Версия родительской темы сайта.','The ISO3166 alpha-2 country code to save for the current user.'=>'Код страны ISO3166 alpha-2 текущего пользователя, который следует сохранить.','The item product or variation ID.'=>'ID товара или вариации.','The item type.'=>'Тип объекта.','The key of the meta data.'=>'Ключ метаданных.','The key that will be used when dealing with MaxMind Geolocation services. You can read how to generate one in <a href="%1$s">MaxMind Geolocation Integration documentation</a>.'=>'Ключ для использования с службами геолокации MaxMind. Вы можете прочитать как создать его в <a href="%1$s">документации по интеграции MaxMind</a>.','The largest filesize that can be contained in one post.'=>'Максимальный размер файла, который может содержаться в одной записи.','The largest filesize that can be uploaded to your WordPress installation.'=>'Наибольший размер файла, который может быть загружен на ваш сайт.','The layout of the note (e.g. banner, thumbnail, plain).'=>'Макет примечания (например: баннер, миниатюра, без форматирования).','The legacy REST API is enabled'=>'Устаревшее расширение REST API включено','The legacy REST API is NOT enabled'=>'Устаревшее расширение REST API НЕ включено','The Legacy REST API plugin is not installed on this site.'=>'Устаревший плагин REST API на этом сайте не установлен.','The link to disable the test account for the payment gateway.'=>'Ссылка отключения тестовой учётной записи платежного шлюза.','The link to dismiss the incentive.'=>'Ссылка, чтобы скрыть стимул.','The link to hide the suggestion.'=>'Ссылка, чтобы скрыть предложение.','The link to mark the suggestion as attached. This should be called when an extension is installed.'=>'Ссылка для закрепления предложения. Это должно вызываться при установке расширения.','The link to reset the provider state/account and restart the onboarding.'=>'Ссылка сброса состояния/учётной записи провайдера и перезапуска адаптации.','The link to the settings page for the payment gateway.'=>'Ссылка на страницу настроек платёжного шлюза.','The list of recommended payment methods details for the payment gateway.'=>'Список подробных сведений о рекомендованных способах оплаты для платёжного шлюза.','The list of suggestions, excluding the ones part of the providers list.'=>'Список предложений, исключая вошедшие в список поставщика.','The location argument must be a string.'=>'Аргумент местоположения должен иметь строковое значение.','The location argument must be a valid ISO3166 alpha-2 country code.'=>'Аргумент местоположения должен представлять собой действительный код страны ISO3166 alpha-2.','The location that the MaxMind database should be stored. By default, the integration will automatically save the database here.'=>'Место, где следует хранить базу данных MaxMind. По умолчанию интеграция автоматически сохранит базу данных здесь.','The logging handler class.'=>'Класс обработчика ведения журналов.','The logical relationship between attributes when filtering across multiple at once.'=>'Логическая связь между атрибутами при одновременной фильтрации по нескольким.','The management details of the provider.'=>'Сведения об управлении поставщиком.','The marketing channel that this campaign type belongs to.'=>'Маркетинговый канал, к которому относится данный тип кампаний.','The maximum allowed setting is %d'=>'Максимально допустимое значение: %d','The maximum amount of memory (RAM) that your site can use at one time.'=>'Максимальное количество памяти (RAM), которое ваш сайт может использовать единовременно.','The maximum number of individual items this coupon can apply to when using product discounts. Leave blank to apply to all qualifying items in cart.'=>'Максимальное число индивидуальных элементов на которые распространяется купон при использовании скидки. Оставьте пустым чтобы применить на все перечисленные объекты в корзине.','The maximum number of variables your server can use for a single function to avoid overloads.'=>'Максимальное количество переменных, которое ваш сервер может использовать для одной функции чтобы предотвратить перезагрузку.','The maximum quantity allowed for this line item.'=>'Максимально возможное количество для этого артикула.','The maximum quantity of &quot;%1$s&quot; allowed in the cart is %2$s'=>'Максимальное количество «%1$s» в корзине — %2$s','The maximum quantity that can be added to the cart.'=>'Максимальное количество товаров в корзине.','The maximum spend for coupon "%1$s" is %2$s.'=>'Максимальная сумма оплаты купоном «%1$s»: %2$s.','The MaxMind license key is invalid. If you have recently created this key, you may need to wait for it to become active.'=>'Ключ рецензии MaxMind неверен. Если вы недавно его создали, то возможно вам стоит подождать пока он станет активен.','The meta data array.'=>'Массив метаданных.','The meta data object.'=>'Объект метаданных.','The meta key to delete.'=>'Ключ метаданных для удаления.','The metaboxhidden_product meta from the user metas.'=>'Метаданные metaboxhidden_product из профиля пользователя.','The Mini-Cart template allows shoppers to see their cart items and provides access to the Cart and Checkout pages.'=>'Шаблон мини-корзины позволяет покупателям видеть товары в корзине и обеспечивает доступ к корзине и оформлению заказа.','The minimum allowed setting is %d'=>'Минимально допустимая настройка - %d','The minimum quantity allowed for this line item.'=>'Минимально возможное количество для этого артикула.','The minimum quantity of &quot;%1$s&quot; allowed in the cart is %2$s'=>'Минимальное количество «%1$s» в корзине — %2$s','The minimum quantity that can be added to the cart.'=>'Минимальное количество товаров в корзине.','The minimum severity level of logs that will be stored.'=>'Минимальный уровень серьёзности записей журнала, которые будут храниться.','The minimum spend for coupon "%1$s" is %2$s.'=>'Минимальная сумма оплаты купоном «%1$s»: %2$s.','The name of the current active theme.'=>'Название активной темы сайта.','The name of the marketing channel that this campaign type belongs to.'=>'Название маркетингового канала, к которому относится данный тип кампаний.','The name of the parent theme.'=>'Название родительской темы.','The name of the tax.'=>'Название налога.','The name of your physical store.'=>'Название вашего физического магазина.','The next queue will begin processing in approximately %d seconds.'=>'Обработка следующей очереди начнется примерно через %d сек.','The number of days log entries are retained.'=>'Сколько дней хранятся записи журнала.','The number of decimal points shown in displayed prices.'=>'Количество знаков после запятой, отображаемых в ценах.','The number of search results has reached the limit of %s. Try refining your search.'=>'Число результатов поиска достигло предела в %s. Попробуйте уточнить критерии поиска.','The number of unique pages viewed by the customer prior to this order.'=>'Число уникальных страниц, просмотренных клиентом до оформления этого заказа.','The object cannot be deleted.'=>'Объект не может быть удалён.','The object does not support trashing. Set \'%s\' to delete.'=>'Объект не поддерживает удаление в мусорку. Установите «%s» для удаления.','The object has already been trashed.'=>'Объект уже удалён в мусорку.','The official Razorpay extension for WooCommerce allows you to accept credit cards, debit cards, netbanking, wallet, and UPI payments.'=>'Официальное расширение Razorpay для WooCommerce позволяет вам принимать к оплате кредитные карты, дебетовые карты, производить расчёты с помощью банковских интернет-систем, электронных кошельков и UPI.','The onboarding preload link for the payment gateway.'=>'Ссылка предзагрузки для платёжного шлюза.','The onboarding step ID is invalid: %s'=>'Недопустимый ID шага загрузки: %s','The onboarding step is missing required entries: %s'=>'На этапе адаптации отсутствуют обязательные записи: %s','The onboarding steps in case this provider supports native in-context onboarding.'=>'Шаги по адаптации в случае, если этот провайдер поддерживает встраивание адаптацию в контексте.','The onboarding steps.'=>'Этапы регистрации.','The options are &quot;Active&quot; (delivers payload), &quot;Paused&quot; (does not deliver), or &quot;Disabled&quot; (does not deliver due delivery failures).'=>'Параметры: &quot;Активно&quot; (доставляет нагрузку), &quot;Приостановлено&quot; (не доставляется), or &quot;Выключено&quot; (не доставляется по причине проблем с доставкой).','The Order Confirmation template serves as a receipt and confirmation of a successful purchase. It includes a summary of the ordered items, shipping, billing, and totals.'=>'Шаблон подтверждения заказа выполняет функцию квитанции и подтверждает успешное оформление покупки. Он включает в себя сводную информацию о заказанных товарах, доставке, выставления счёта и итоговых суммах.','The order details screen is easy to use.'=>'Экран сведений о заказе прост в использовании.','The order details screen\'s functionality meets my needs.'=>'Функциональность экрана сведений о заказе соответствует моим потребностям.','The order has been received, but no payment has been made. Pending payment orders are generally awaiting customer action.'=>'Заказ получен, но оплата не произведена. Заказы в статусе ожидания оплаты, как правило, требуют действий со стороны покупателя.','The order ID is required.'=>'Требуется ID заказа.','The order ID that notes belong to.'=>'ID заказа, к которому принадлежат примечания.','The order ID to process during checkout.'=>'ID заказа для обработки во время оформления заказа.','The order ID.'=>'ID заказа.','The order is awaiting payment confirmation. Stock is reduced, but you need to confirm payment.'=>'Заказ ожидает подтверждения оплаты. Запас товара уменьшился, но вы должны подтвердить оплату.','The order totals have been updated. Please confirm your order by pressing the "Place order" button at the bottom of the page.'=>'Итоговая сумма заказа обновлена. Пожалуйста, подтвердите заказ нажатием на кнопку "Разместить заказ" внизу страницы.','The order value must be an integer.'=>'Стоимость заказа должна быть целым числом.','The order was canceled by an admin or the customer.'=>'Заказ отменён администратором или покупателем.','The ordered offline payment methods providers list.'=>'Упорядоченный список поставщиков офлайн-способов оплаты.','The ordered providers list. This includes registered payment gateways, suggestions, and offline payment methods group entry. The individual offline payment methods are separate.'=>'Список поставщиков по порядку. Включает зарегистрированные платёжные шлюзы, предложения и запись группы офлайн-способов оплаты. Индивидуальные офлайн-способы оплаты указаны отдельно.','The ordering argument must be an object with provider IDs as keys and numeric values as values.'=>'Аргумент упорядочивания должен быть объектом с идентификаторами поставщика в качестве ключей и числовыми значениями в качестве значений.','The ordering argument must be an object.'=>'Аргумент упорядочивания должен быть объектом.','The organic coffee beans are a revelation. Each sip feels like a journey. Beautifully crafted accessories add a touch of elegance to my 