nt gateway for this order does not exist.'=>'Платежного шлюза для этого заказа не существует.','The payment gateway for this order does not support automatic refunds.'=>'Платёжный шлюз, использованный при обработке заказа не поддерживает автоматический возврат средств.','The plugin could not be activated.'=>'Не удалось активировать плагин.','The plugin for your subscription couldn\'t be activated.'=>'Не удалось активировать плагин для вашей подписки.','The plugin for your subscription has been activated.'=>'Плагин для вашей подписки активирован.','The plugin main file. This is a relative path to the plugins directory.'=>'Основной файл плагина. Это относительный путь к директории плагинов.','The position of the currency symbol.'=>'Позиция символа валюты.','The post ID of the generated email post.'=>'ID сгенерированной письмом записи.','The postal code, if any, in which your business is located.'=>'Почтовый индекс, если есть, для вашего магазина.','The previous status of order %1$d ("%2$s") is invalid. It could not be restored.'=>'Предыдущий статус заказа %1$d ("%2$s") недействителен. Его восстановить невозможно.','The previous status of order %1$d ("%2$s") is invalid. It has been restored to "pending" status instead.'=>'Предыдущий статус заказа %1$d ("%2$s") недействителен. Он был переведён в статус "на утверждении".','The priority of the category.'=>'Приоритет рубрики.','The priority of the suggestion.'=>'Приоритет предложения.','The product category details screen is easy to use.'=>'Экран сведений о категории товара прост в использовании.','The product category details screen\'s functionality meets my needs.'=>'Функциональность экрана сведений о категории товара соответствует моим потребностям.','The product creation screen is easy to use.'=>'Экран создания товара прост в использовании.','The product creation screen\'s functionality meets my needs.'=>'Функциональность экрана создания товара соответствует моим потребностям.','The product import process is easy to complete.'=>'Процесс импорта товара легко завершить.','The product import process meets my needs.'=>'Процесс импорта товара соответствует моим потребностям.','The product review cannot be deleted.'=>'Отзыв товара не может быть удалён.','The product review does not support trashing.'=>'Отзывы на товары не поддерживают удаление в мусорку.','The product tag details screen is easy to use.'=>'Экран сведений о метке товара прост в использовании.','The product tag details screen\'s functionality meets my needs.'=>'Функциональность экрана сведений о товаре соответствует моим потребностям.','The product update process is easy to complete.'=>'Процесс обновления товара легко завершить.','The product update process meets my needs.'=>'Процесс обновления товара отвечает моим потребностям.','The product with SKU (%1$s) you are trying to insert is already present in the lookup table'=>'Товар с артикулом (%1$s), который вы пытаетесь вставить, уже указан в таблице обзора','The provided checkout link was out of date or invalid. No products were added to the cart.'=>'Предоставленная ссылка для оформления заказа устарела или недействительна. Товары не были добавлены в корзину.','The provided email address (%s) is not valid—please provide a valid email address'=>'Указанный адрес электронной почты (%s) недействителен – укажите действующий адрес электронной почты','The provided email address is not valid'=>'Предоставленный Email недействителен','The provided handler %1$s does not implement %2$s.'=>'Предоставленный обработчик %1$s не выполняет %2$s.','The provided phone number is not valid'=>'Предоставленный телефон недействителен','The provided postcode / ZIP is not valid'=>'Указан неверный почтовый индекс','The provided state (%1$s) is not valid. Must be one of: %2$s'=>'Указанное состояние (%1$s) недопустимо. Допустимы: %2$s','The provider class for gateway ID "%s" must extend the PaymentGateway class.'=>'Класс провайдера ID шлюза «%s» должен расширять класс PaymentGateway.','The provider class for payment extension suggestion ID "%s" must extend the PaymentGateway class.'=>'Класс сервиса предложения расширенного платежа с ID «%s» должен расширять класс PaymentGateway.','The provider ID must be a string with only ASCII letters, digits, underscores, and dashes.'=>'ID сервиса должен представлять собой строку, состоящую только из букв ASCII, цифр, подчеркивания и тире.','The quantity of &quot;%1$s&quot; cannot be changed'=>'Количество «%1$s» изменить нельзя','The quantity of &quot;%1$s&quot; must be a multiple of %2$s'=>'Количество «%1$s» должно быть кратно %2$s','The rate at which tax is applied.'=>'Применяемая ставка налога.','The relative path of the step to use for frontend navigation.'=>'Относительный путь этапа для навигации по интерфейсу.','The requested plugin `%s` could not be activated.'=>'Требуемый плагин `%s` не может быть активирован.','The requested plugin `%s` could not be installed.'=>'Не удалось установить запрошенный плагин %s.','The requested plugin `%s` could not be installed. Plugin API call failed.'=>'Не удалось установить запрошенный плагин %s. Ошибка вызова API плагина.','The requested plugin `%s` could not be installed. Upgrader install failed.'=>'Невозможно установить требуемый плагин «%s». Сбой инструмента установки обновления.','The requested plugin `%s`. is not yet installed.'=>'Требуемый плагин «%s» ещё не установлен.','The requested theme `%s` could not be installed.'=>'Не удалось установить запрошенную тему %s.','The requested theme `%s` could not be installed. Theme API call failed.'=>'Не удалось установить запрошенную тему %s. Ошибка при вызове API темы.','The requested theme could not be activated.'=>'Запрашиваемая тема не может быть активирована.','The resource cannot be deleted.'=>'Этот ресурс не может быть удалён.','The response body from the receiving server.'=>'Тело ответа от принимающего сервера.','The response message.'=>'Ответное сообщение.','The Retro Glass Jug\'s classic silhouette effortlessly complements any