lugin.'=>'Слаг плагина.','The sort order of the payment method.'=>'Порядок сортировки способа оплаты.','The sort order of the provider.'=>'Порядок сортировки поставщика.','The specific chart this stat referrers to.'=>'Конкретный график, на который ссылается этот параметр.','The specified category for recommendations is invalid. Allowed values: "channels", "extensions".'=>'Указанная категория рекомендаций недействительна. Допустимые значения: "каналы", "расширения".','The start/continue onboarding link for the payment gateway.'=>'Ссылка для начала или продолжения регистрации в платёжном шлюзе.','The state of the onboarding process.'=>'Статус процесса регистрации.','The status of the containing entity.'=>'Статус содержащего объекта.','The status of the coupon. Should always be draft, published, or pending review'=>'Статус купона. Всегда должен быть черновиком, опубликованным или в ожидании проверки','The status of the fulfillment.'=>'Статус выполнения.','The status of the note (e.g. unactioned, actioned).'=>'Статус заметки (например, не обработано, выполнено действие).','The status of the plugin.'=>'Статус плагина.','The step definition to import'=>'Определение этапа, которое требуется импортировать','The steps that are required to be completed before this step.'=>'Этапы, которые необходимо выполнить перед этим этапом.','The stock has not been updated because the value has changed since editing. Product %1$d has %2$d units in stock.'=>'Данные по запасам не были обновлены, так как количество было изменено с момента редактирования. Товар %1$d имелся в количестве %2$d шт.','The street address for your business location.'=>'Почтовый адрес вашего магазина.','The suggestion categories.'=>'Рубрики предложения.','The suggestion ID matching this provider.'=>'Идентификатор предложения, соответствующий этому поставщику.','The tags associated with the provider.'=>'Теги, связанные с поставщиком.','The tags associated with the suggestion.'=>'Теги, связанные с предложением.','The term ID, or 0 if the attribute is not a global attribute.'=>'ID значения или 0, если атрибут не является глобальным.','The term name.'=>'Название значения.','The term slug.'=>'Ярлык значения.','The theme developers URL.'=>'URL разработчика темы.','The theme you are currently using is not compatible.'=>'Ваша текущая тема несовместима.','The thousand separator of displayed prices.'=>'Тысячный разделитель при отображении цен.','The title of the category.'=>'Название рубрики.','The title of the order note group.'=>'Название группы примечаний к заказу.','The title of the payment method. Does not include HTML tags.'=>'Название способа оплаты. Не содержит HTML-тегов.','The title of the provider.'=>'Название поставщика.','The title of the suggestion.'=>'Заголовок предложения.','The total size of the files in the log directory.'=>'Общий размер файлов в директории журнала.','The tracking number details response.'=>'Ответ со сведениями о номере отправления.','The tracking number to look up.'=>'Поиск по номеру отправления.','The tracking number.'=>'Номер отправления.','The tracking URL.'=>'URL-адрес для отслеживания.','The type of entity for which the fulfillment is created.'=>'Тип объекта, для которого создано выполнение.','The type of entity for which the fulfillment is created. Must be "order".'=>'Тип объекта, для которого запускается механизм обработки. Должен быть «Заказ».','The type of onboarding process the provider supports.'=>'Тип процесса адаптации, поддерживаемый поставщиком.','The type of payment provider. Use this to differentiate between the various items in the list and determine their intended use.'=>'Тип поставщика платёжных услуг. Пользуйтесь этим, чтобы определять разницу между различными товарами в списке и указывать их предполагаемое назначение.','The type of the containing entity. Generally this is a regular plugin but it can also be a non-standard entity like a theme or a must-user plugin.'=>'Тип содержащего объекта. Как правило, это обычный плагин, но это также может быть нестандартный объект, такой как тема или обязательный для пользователя плагин.','The type of the link.'=>'Тип ссылки.','The type of the note (e.g. error, warning, etc.).'=>'Тип заметки (например, ошибка, предупреждение и т. д.)','The type of the plugin.'=>'Тип плагина.','The type of the suggestion.'=>'Тип предложения.','The unique identifier for the category.'=>'Уникальный идентификатор рубрики.','The unique identifier for the marketing campaign type.'=>'Уникальный идентификатор типа маркетинговой кампании.','The unique identifier for the marketing campaign.'=>'Уникальный идентификатор для маркетинговой кампании.','The unique identifier for the marketing channel that this campaign belongs to.'=>'Уникальный идентификатор маркетингового канала, к которому относится данная кампания.','The unique identifier for the meta data. Set `0` for new records.'=>'Уникальный идентификатор метаданных. Установите «0» для новых записей.','The unique identifier for the payment method.'=>'Уникальный идентификатор способа оплаты.','The unique identifier for the provider.'=>'Глобальный уникальный идентификатор поставщика.','The unique identifier for the step.'=>'Уникальный идентификатор этапа.','The unique identifier for the suggestion.'=>'Уникальный идентификатор предложения.','The unique identifier of the marketing channel that this campaign type belongs to.'=>'Уникальный идентификатор маркетингового канала, к которому относится данный тип кампаний.','The unit lengths are defined in for this country.'=>'Единичные длины определены для этой страны.','The unit weights are defined in for this country.'=>'Объёмные веса определены для этой страны.','The upmost entry point from where the merchant entered the onboarding flow.'=>'Самая верхняя точка входа, из которой продавец вошёл в процесс регистрации.','The URL of the icon (square aspect ratio).'=>'URL-адрес значка (изображение квадратной формы).','The URL of the image.'=>'URL-адрес изображения.','The URL of the link.'=>'URL-адрес ссылки.','The URL of the payment method icon or a base64-encoded SVG image.'=>'URL-адрес значка способа платежа или SVG-изображение в кодировке base64.','The URL of the provider icon (square aspect ratio - 72px by 72px).'=>'URL-адрес значка поставщика (изображение квадратной формы 72 х 72 пикс.).','The URL of the provider image.'=>'URL-адрес изображения поставщика.','The URL of your %s page (along with the Page ID).'=>'URL-адрес вашей страницы %s (а также ID страницы).','The URL to attach the suggestion.'=>'URL прикрепления предложения.','The URL to dismiss the incentive.'=>'URL-адрес, чтобы скрыть стимул.','The URL to do onboarding preload for the payment gateway.'=>'URL предзагрузки адаптации для платёжного шлюза.','The URL to hide the suggestion.'=>'URL-адрес, чтобы скрыть предложение.','The URL to POST to disable the test account for the payment gateway.'=>'URL для POST, чтобы отключить тестовую учётную запись платёжного шлюза.','The URL to POST to for resetting the provider onboarding.'=>'URL для POST для сброса адаптации провайдера.','The URL to start/continue onboarding for the payment gateway.'=>'URL-адрес для начала или продолжения регистрации в платёжном шлюзе.','The URL to the settings page for the payment gateway.'=>'URL-адрес страницы настроек платёжного шлюза.','The URL to the terms and conditions for the incentive.'=>'URL-адрес правил и условий стимула.','The URL to use for the action.'=>'URL-адрес, применяемый при действии.','The URL where the webhook payload is delivered.'=>'URL, куда доставлена нагрузка вебзацепа.','The URL where the webhook was delivered.'=>'URL, на который был доставлен вебзацеп.','The user associated with this API key no longer exists.'=>'Пользователя, связанного с этим ключом API, больше не существует.','The value of the meta data.'=>'Значение метаданных.','The value type for the JSON partial matching is not supported. Must be either integer, boolean, double or string. %s type provided.'=>'Тип значения для частичного сопоставления JSON не поддерживается. Должно быть либо целым числом, либо логическим значением, либо двойным, либо строковым. Предоставленный тип %s.','The version of cURL installed on your server.'=>'Версия cURL, установленная на вашем сервере.','The version of MySQL installed on your hosting server.'=>'Версия MySQL, установленная на сервере вашего хостинга.','The version of PHP installed on your hosting server.'=>'Версия PHP, установленная на сервере вашего хостинга.','The version of WooCommerce installed on your site.'=>'Версия WooCommerce, установленная на вашем сайте.','The version of WordPress installed on your site.'=>'Версия WordPress, используемая на вашем сайте.','The WooCommerce Helper plugin is no longer needed. <a href="%s">Manage subscriptions</a> from the extensions tab instead.'=>'Плагин WooCommerce Helper больше не нужен. <a href="%s">Для управления подписками</a> переходите во вкладку «Расширения».','The WooCommerce Legacy REST API plugin running on this site.'=>'На этом сайте работает устаревший плагин WooCommerce REST API.','The WooCommerce REST API allows external apps to view and manage store data. Access is granted only to those with valid API keys.'=>'API-интерфейс WooCommerce REST позволяет просматривать и изменять настройки магазина с помощью сторонних приложений. Доступ предоставляется только приложениям с действительными API-ключами.','The world’s favorite buy now, pay later options and many more are right at your fingertips with WooPayments — all from one dashboard, without needing multiple extensions and logins.'=>'Благодаря WooPayments теперь в вашем распоряжении популярная во всём мире опция рассрочки «купи сейчас, плати потом» (BNPL) и множество других функций — все управляются централизованно с единой консоли, и вам не придётся устанавливать многочисленные расширения и запоминать множество паролей.','Theme'=>'Тема','Theme author URL.'=>'URL автора темы.','Theme installation message.'=>'Тема установки сообщения.','Theme installation status.'=>'Тема установки статуса.','Theme name.'=>'Название темы.','Theme slug.'=>'Строка темы.','Theme status.'=>'Статус темы.','Theme type'=>'Тип темы','Theme version.'=>'Версия темы.','Theme.'=>'Тема.','Themes'=>'Темы','There are currently no logs to view.'=>'Сейчас здесь нет журналов для просмотра.','There are environment or store setup issues which are blocking progress. Please resolve them to proceed.'=>'Существуют проблемы с настройкой среды или хранилища, которые блокируют процесс. Устраните их, чтобы продолжить.','There are no currencies matching these parameters.'=>'Нет валют, соответствующих этим параметрам.','There are no locations matching these parameters.'=>'Нет местоположений, соответствующих этим параметрам.','There are no notes yet.'=>'Заметок пока нет.','There are no orders to sync, aborting.'=>'Нет заказов для переноса, отбой.','There are no orders to verify, aborting.'=>'Нет заказов для проверки, выполняется отмена.','There are no product reviews yet.'=>'Отзывов о товарах ещё нет.','There are no reviews yet.'=>'Отзывов пока нет.','There are no shipping options available. Please ensure that your address has been entered correctly, or contact us if you need any help.'=>'Нет доступных способов доставки. Пожалуйста, убедитесь, что вы ввели корректный адрес, или свяжитесь с нами для получения помощи.','There are not enough %s in stock. Please reduce the quantities in your cart.'=>'%s заканчиваются на складе. Уменьшите количество в вашей корзине.','There are orders pending sync.'=>'Есть заказы, ожидающие синхронизации.','There are some issues with the items in your cart. Please go back to the cart page and resolve these issues before checking out.'=>'Возникли проблемы с товарами в вашей корзине. Пожалуйста, вернитесь на страницу корзины и решите эти проблемы перед оформлением заказа.','There are too many %s in the cart. Only 1 can be purchased. Please reduce the quantity in your cart.'=>'В корзине слишком много %s. пожалуйста уменьшите количество в корзине до 1.','There are too many %s in the cart. Only 1 of each can be purchased. Please reduce the quantities in your cart.'=>'В корзине слишком много %s. пожалуйста уменьшите количество каждого товара в корзине до 1.','There are too many concurrent batches, but the run is forced to continue.'=>'Слишком много параллельных пакетов, но выполнение принудительно продолжается.','There are too many concurrent batches.'=>'Слишком много параллельных пакетов.','There is %1$d order to be synced.'=>'Есть %1$d заказ для переноса.' . "\0" . 'Есть %1$d заказа для переноса.' . "\0" . 'Есть %1$d заказов для переноса.','There is %1$d order to be verified.'=>'Есть %1$d заказ для проверки.' . "\0" . 'Заказов для проверки: %1$d.' . "\0" . 'Заказов для проверки: %1$d.','There is no data to export for the given request.'=>'Нет данных для экспорта по данному запросу.','There is not enough %s in stock. Please reduce the quantity in your cart.'=>'%s заканчивается на складе. Уменьшите количество в вашей корзине.','There was a failure fetching this action'=>'Не удалось получить это действие','There was a failure fetching this action: %s'=>'Не удалось получить это действие %s','There was a failure scheduling the next instance of this action: %s'=>'Произошла ошибка при планировании следующего экземпляра этого действия: %s','There was a problem activating some of the requested plugins.'=>'При активации некоторых требуемых плагинов возникла проблема.','There was a problem installing some of the requested plugins.'=>'При установке некоторых требуемых плагинов возникла проблема.','There was a problem with the provided %s:'=>'Возникла проблема с предоставленным %s:','There was a problem with the provided billing address: %s'=>'Проблема с указанным платёжным адресом: %s','There was a problem with the provided shipping address: %s'=>'Проблема с указанным адресом доставки: %s','There was an error activating this plugin.'=>'Произошла ошибка при активации этого плагина.','There was an error activating this theme.'=>'Произошла ошибка при активации этой темы.','There was an error calling %1$s: %2$s'=>'Произошла ошибка вызова %1$s: %2$s','There was an error calling %s'=>'Произошла ошибка вызова %s','There was an error calling this tool. There is no callback present.'=>'При вызове этой службы произошла ошибка. Нет обратного вызова.','There was an error cancelling the %1$s: %2$s'=>'Произошла ошибка при отмене %1$s: %2$s','There was an error communicating with the WooPayments plugin.'=>'Произошла ошибка при обмене данными с плагином WooPayments.','There was an error connecting to Square.'=>'Произошла ошибка при подключении Square.','There was an error connecting to WooCommerce.com. Please try again.'=>'Произошла ошибка при подключении WooCommerce.com. Повторите попытку.','There was an error connecting your subscription. Please try again.'=>'Произошла ошибка при подключении подписки. Повторите попытку.','There was an error creating the scheduled action: %s'=>'При создании запланированного действия произошла ошибка: %s','There was an error deleting an action: %s'=>'Произошла ошибка при удалении действия: %s','There was an error disconnecting your subscription. Please try again.'=>'Произошла ошибка при отключении подписки. Повторите попытку.','There was an error generating your API Key.'=>'При создании ключа API произошла ошибка.','There was an error getting the install URL for this product.'=>'Произошла ошибка при получении URL установки для этого товара.','There was an error loading the WooCommerce.com Helper API.'=>'При загрузке API WooCommerce.com Helper произошла ошибка.','There was an error processing your order. Please check for any charges in your payment method and review your <a href="%s">order history</a> before placing the order again.'=>'Произошла ошибка при обработке вашего заказа. Проверьте, нет ли каких-либо дополнительных комиссий в выбранном способе оплаты и просмотрите <a href="%s">историю своих заказов</a>, прежде чем оформлять заказ повторно.','There was an error rendering an email preview.'=>'При загрузке предпросмотра письма возникла ошибка.','There was an error rendering the email editor placeholder content.'=>'При отображении содержимого-заполнителя редактора электронной почты произошла ошибка.','There was an error rendering the email preview.'=>'Произошла ошибка при отрисовки предпросмотра письма.','There was an error rendering the email preview. This doesn\'t affect actual email delivery. Please contact the extension author for assistance.'=>'При отображении предварительного просмотра рассылки возникла ошибка. Это не влияет на фактическую доставку рассылки. Обратитесь за помощью к автору расширения.','There was an error running the action scheduler: %s'=>'В процессе работы планировщика действий произошла ошибка: %s','There was an error with an item in your cart.'=>'Произошла ошибка с товаром в вашей корзине.','There was an issue loading the report endpoints'=>'При загрузке эндпоинтов отчёта возникла проблема','There\'s %d webhook that is configured to be delivered using the Legacy REST API, which has been removed from WooCommerce. This webhook will fail to be sent.'=>'Имеются веб-перехватчики (%d), настроенные для доставки с использованием устаревшего REST API, удалённого из WooCommerce. Этот веб-перехватчик отправить не удастся.' . "\0" . 'Имеются веб-перехватчики (%d), настроенные для доставки с использованием устаревшего REST API, удалённого из WooCommerce. Эти веб-перехватчики отправить не удастся.' . "\0" . 'Имеются веб-перехватчики (%d), настроенные для доставки с использованием устаревшего REST API, удалённого из WooCommerce. Эти веб-перехватчики отправить не удастся.','These account details will be displayed within the order thank you page and confirmation email.'=>'Эти данные учётной записи будут отображаться на странице благодарности за заказ и в электронном письме с подтверждением.','These costs can optionally be added based on the <a href="%s">product shipping class</a>.'=>'Эти цены могут быть опционально добавлены в соответствии с <a href="%s">классом доставки товара</a>.','These costs can optionally be added based on the <a target="_blank" href="%s">product shipping class</a>. Learn more about <a target="_blank" href="https://woocommerce.com/document/flat-rate-shipping/#shipping-classes">setting shipping class costs</a>.'=>'Эти цены могут быть опционально добавлены в соответствии с <a target="_blank" href="%s">классом доставки товара</a>. Подробнее о <a target="_blank" href="https://woocommerce.com/document/flat-rate-shipping/#shipping-classes">настройке тарифов на доставку различными классами</a>.','These features are either experimental or incomplete, enable them at your own risk!'=>'Этот функционал является либо экспериментальным, либо неполным. Включайте его на свой страх и риск!','These options let you change the appearance of the WooCommerce checkout.'=>'Эти функции позволяют изменить внешний вид страницы оформления заказа WooCommerce.','These pages need to be set so that WooCommerce knows where to send users to checkout.'=>'Эти страницы нужны для того, чтобы система могла перенаправлять пользователей к оформлению заказа.','These rates are extra shipping options with additional costs (based on the flat rate).'=>'Дополнительные опции доставки, имеющие дополнительную цену (основано на единой ставке).','These settings are not available while the lookup table regeneration is in progress.'=>'Эти настройки недоступны во время регенерации таблицы обзора.','Thessaly'=>'Фессалия','Things to do next'=>'Что делать дальше','This action appears to be consistently failing. A new instance will not be scheduled.'=>'Похоже, что это действие постоянно завершается неудачей. Новый экземпляр не будет запланирован.','This action cannot be reversed. Are you sure you wish to erase personal data from the selected orders?'=>'Это действие не может быть отменено. Вы уверены, что хотите удалить персональные данные из выбранных заказов?','This controls how stock quantities are displayed on the frontend.'=>'Здесь вы можете настроить, как количество товара в наличии будет отображаться во внешнем интерфейсе.','This controls the description which the user sees during checkout.'=>'Описание, которое видит пользователь при оформлении заказа.','This controls the position of the currency symbol.'=>'Управляет положением символа валюты.','This controls the title which the user sees during checkout.'=>'Заголовок, который видит пользователь в процессе оформления заказа.','This controls what currency prices are listed at in the catalog and which currency gateways will take payments in.'=>'Эти настройки позволяют определить в какой валюте перечислены цены в каталоге и какие платежные шлюзы будут использоваться.','This controls what unit you will define lengths in.'=>'Здесь определяется единица измерения, в которой определяется длина.','This controls what unit you will define weights in.'=>'Здесь определяется единица измерения, в которой определяется вес.','This controls which shipping address is used by default.'=>'Здесь определяется какой адрес доставки будет использоваться по умолчанию.','This coupon is password protected. WooCommerce does not support password protection for coupons. You can temporarily hide a coupon by making it private. Alternatively, usage limits and restrictions can be configured below.'=>'Этот купон защищён паролем. WooCommerce не поддерживает защиту паролем для купонов. Можно временно скрыть купон, сделав его закрытым. Либо настройте ограничения и пределы использования ниже.','This data will be deleted in %s.'=>'Эти данные будут удалены в %s.','This determines where log entries are saved.'=>'Этот параметр определяет, где хранятся записи журнала.','This email address is already registered.'=>'Этот адрес e-mail уже зарегистрирован.','This feature is not available when using the <a href="%s">Cart and checkout blocks</a>. Shipping will be calculated at checkout.'=>'Эта функция недоступна при использовании <a href="%s">блоков корзины и оформления заказа</a>. Стоимость доставки будет рассчитана при оформлении заказа.','This feature is only available with the Cart & Checkout blocks. %1$sLearn more%2$s.'=>'Эта функция доступна только при наличии блоков «Корзина» и «Оформление заказа». %1$sПодробнее%2$s.','This field allows you to set the maximum spend (subtotal) allowed when using the coupon.'=>'Это поле позволяет установить максимальную сумму, необходимую для применения купона.','This field allows you to set the minimum spend (subtotal) allowed to use the coupon.'=>'Это поле позволяет установить минимальную сумму, необходимую для применения купона.','This file does not exist.'=>'Такого файла не существует.','This function should not be called before plugins_loaded.'=>'Эта функция не должна вызываться до события plugins_loaded.','This function should not be called before woocommerce_init.'=>'Эта функция не должна быть вызвана перед woocommerce_init.','This info will be displayed on the product page, category pages, social media, and search results.'=>'Эти данные будут показываться на странице товара, страницах рубрик, в социальных сетях и в результатах поиска.','This is a customer note. Customers can add a note to their order on checkout.

It can be multiple lines. If there\'s no note, this section is hidden.'=>'Это примечание клиента. Клиенты могут добавлять примечание к своему заказу при его оформлении. 

Оно может содержать нескольких строк. Если примечание отсутствует, этот раздел будет скрыт.','This is a demo store for testing purposes &mdash; no orders shall be fulfilled.'=>'Это демо-магазин для тестирования &mdash; заказы не исполняются.','This is a featured product'=>'Это рекомендуемый товар','This is an order notification sent to customers containing order details after an order is placed on-hold from Pending, Cancelled or Failed order status.'=>'Это уведомление, содержащее детали заказа, отправляется клиенту после того, как заказ переведён в режим удержания из статуса ожидания, отмены или неудачного.','This is an order notification sent to customers containing order details after payment.'=>'Это уведомление содержит детали заказа и отправляется клиенту после оплаты.','This is not your download link.'=>'Это не ваша ссылка на скачивание.','This is the attachment ID, or image URL, used for placeholder images in the product catalog. Products with no image will use this.'=>'Это ID вложения или URL изображения, используемый для заполнителей в каталоге продукции. Они будут использоваться для товаров без изображения.','This is the Customer Lifetime Value, or the total amount you have earned from this customer\'s orders.'=>'Это пожизненная ценность клиента или общая сумма, которую вы заработали на заказах этого клиента.','This is the default category and it cannot be deleted. It will be automatically assigned to products with no category.'=>'Это категория по умолчанию, и её нельзя удалить. Она автоматически присваивается товарам без категории.','This is the name of the download shown to the customer.'=>'Это название скачивания которое будет отображаться клиенту.','This is the sum of the "Tax rows" shipping tax amount within your orders.'=>'Это сумма "Налоговых Ставок" налогов на доставку в пределах ваших заказов.','This is the sum of the "Tax rows" tax amount within your orders.'=>'Это сумма «налоговых ставок» в пределах ваших заказов.','This is the sum of the \'Order total\' field within your orders.'=>'Это сумма поля "Общий заказ" внутри Ваших заказов.','This is the sum of the \'Shipping total\' field within your orders.'=>'Это сумма поля "Общий итог по доставкам" внутри Ваших заказов.','This is the sum of the order totals after any refunds and excluding shipping and taxes.'=>'Это итоговая сумма заказа после всех возвратов и исключая расходы на доставку и налоги.','This is the sum of the order totals after any refunds and including shipping and taxes.'=>'Итоговая сумма всех заказов, включая доставку и налоги, после учёта возвратов.','This is the total tax for the rate (shipping tax + product tax).'=>'Это общая сумма налога для ставки (налоги на доставку + налог на товар).','This is the URL or absolute path to the file which customers will get access to. URLs entered here should already be encoded.'=>'Это URL или абсолютный путь к файлу, по которому клиент получит доступ к нему. Адреса уже должны быть закодированы.','This is the WooCommerce shop page. The shop page is a special archive that lists your products. <a href="%s">You can read more about this here</a>.'=>'Это страница магазина WooCommerce. Страница магазина это специальный архив со списком товаров. Подробнее об этом можно прочитать <a href="%s">здесь</a>.','This is where store orders are stored.'=>'Здесь хранятся заказы.','This is where you can add new coupons that customers can use in your store.'=>'Здесь можно добавить новые купоны, которые пользователи смогут использовать в магазине.','This is where you can browse products in this store.'=>'Здесь вы можете просматривать товары данного магазина.','This is where you can set up product forms for various product types in your dashboard.'=>'Здесь вы можете настроить товарные формы для различных типов товаров на консоли.','This is where your business is located. Tax rates and shipping rates will use this address.'=>'Место где расположен ваш бизнес. Расчёт налогов и стоимости доставки будет производиться учитывая данный адрес.','This item is not available for purchase.'=>'Этот товар недоступен для покупки.','This key is invalid or has already been used. Please reset your password again if needed.'=>'Ваш ключ неверен или уже был использован. Пожалуйста снова сбросьте ваш пароль если нужно.','This lets you choose which products are part of this group.'=>'Здесь вы можете выбрать, какие товары входят в эту группу.','This link will remain active for %s.'=>'Эта ссылка будет оставаться активной до %s.','This means that the table is probably in an inconsistent state. It\'s recommended to run a new regeneration process or to resume the aborted process (Status - Tools - Regenerate the product attributes lookup table/Resume the product attributes lookup table regeneration) before enabling the table usage.'=>'Это означает, что данная таблица, вероятно, несогласована. Перед включением использования таблицы рекомендуется запустить новый процесс регенерации или возобновить прерванный (раздел Статус > Инструменты > Регенерировать таблицу обзора атрибутов товараа/Возобновить регенерацию таблицы обзора атрибутов товара).','This method has been deprecated and will be removed soon. Use Automattic\\WooCommerce\\Utilities\\DiscountsUtil::is_coupon_emails_allowed instead.'=>'Этот метод устарел и скоро будет удалён. Вместо него используйте Automattic\\WooCommerce\\Utilities\\DiscountsUtil::is_coupon_emails_allowed.','This method is deprecated in 2.6.0 and will be removed in future versions - we recommend disabling it and instead setting up a new rate within your <a href="%s">Shipping zones</a>.'=>'Этот метод устарел в версии 2.6.0 и будет удалён в следующих версиях - рекомендуем отключить его и взамен настроить новую ставку, задействуя <a href="%s">зоны доставки</a>.','This method should not be called before plugins_loaded.'=>'Этот метод не должен вызываться до plugins_loaded.','This month'=>'Этот месяц','This option determines a customers default location. The MaxMind GeoLite Database will be periodically downloaded to your wp-content directory if using geolocation.'=>'Эта опция определяет местоположение клиентов по умолчанию. База данных MaxMind GeoLite будет периодически загружаться в вашу директорию wp-content, если геолокация используется.','This option determines which address is used to calculate tax.'=>'Определяет какой адрес будет использоваться для расчёта налога.','This option is important as it will affect how you input prices. Changing it will not update existing products.'=>'Данная опция имеет важное значение, так как она определяет каким образом будут вводиться цены. Изменение не влияет на существующие товары.','This option lets you limit which countries you are willing to sell to.'=>'Опция позволяет ограничить страны, в которых вы собираетесь продавать.','This option will delete ALL of your tax rates, use with caution. This action cannot be reversed.'=>'Эта опция удалит ВСЕ ваши налоговые ставки, используйте с осторожностью. Это действие не может быть отменено.','This order belongs to a different customer.'=>'Этот заказ относится к другому покупателю.','This order cannot be paid for.'=>'Заказ не может быть оплачен.','This order cannot be paid for. Please contact us if you need assistance.'=>'Этот заказ не может быть оплачен. Пожалуйста обратитесь к нам если вам нужна помощь.','This order is already linked to a user account.'=>'Этот заказ уже связан с другой учётной записью.','This order is no longer editable.'=>'Этот заказ больше нельзя редактировать.','This order&rsquo;s status is &ldquo;%s&rdquo;&mdash;it cannot be paid for. Please contact us if you need assistance.'=>'Состояние заказа &ndash; &ldquo;%s&rdquo; и он не может быть оплачен. Пожалуйста, обратитесь к администрации магазина.','This page\'s content is overridden by custom template content'=>'Контент страницы переопределяется контентом пользовательского шаблона.','This password reset key is for a different user account. Please log out and try again.'=>'Данный ключ для смены пароля предназначен для другой учетной записи пользователя. Выйдите из системы и повторите попытку.','This payment method was successfully set as your default.'=>'Этот способ оплаты установлен по умолчанию.','This plugin can no longer be activated because its functionality is now included in <strong>WooCommerce</strong>. It is recommended to <strong>delete</strong> it.'=>'Этот плагин больше нельзя активировать, так как его функции теперь встроены в <strong>WooCommerce</strong>. Рекомендуется <strong>удалить</strong> его.','This plugin cannot be activated because its functionality is now included in WooCommerce core.'=>'Этот плагин больше нельзя активировать, так как его функции теперь встроены в ядро WooCommerce.','This product cannot be added to the cart.'=>'Этот товар нельзя добавить в корзину.','This product has been activated.'=>'Товар активирован.','This product has multiple variants. The options may be chosen on the product page'=>'Этот товар имеет несколько вариаций. Опции можно выбрать на странице товара.','This product has options, such as size or color. You can manage each variation\'s images, downloads, and other details individually.'=>'У этого товара есть опции, такие как размер или цвет. Можно управлять изображениями, скачиваниями и другими деталями каждой вариации в отдельности.','This product has options, such as size or color. You can now manage each variation\'s inventory and other details individually.'=>'У товара есть опции, такие как размер или цвет. Вы можете управлять запасами каждой вариации и другими деталями индивидуально.','This product has options, such as size or color. You can now manage each variation\'s shipping settings and other details individually.'=>'У товара есть опции, такие как размер или цвет. Вы можете управлять способами доставки каждой вариации и другими деталями индивидуально.','This product has produced sales and may be linked to existing orders. Are you sure you want to delete it?'=>'Этот товар продавался и может быть связан с существующими заказами. Вы уверены, что хотите его удалить?','This product is already active.'=>'Этот товар уже активен.','This product is already installed.'=>'Этот товар уже установлен.','This product is currently out of stock and unavailable.'=>'Этого товара нет в наличии, заказ недоступен.','This product is not installed.'=>'Этот товар не установлен.','This product is protected and cannot be purchased.'=>'Этот товар защищён и не может быть куплен.','This product requires shipping or pickup'=>'Этот товар требует доставки или самовывоза','This product will not trigger your customer\'s shipping calculator in cart or at checkout. This product also won\'t require your customers to enter their shipping details at checkout. <a href="https://woocommerce.com/document/managing-products/#adding-a-virtual-product" target="_blank" rel="noreferrer">Read more about virtual products</a>.'=>'Этот товар не активирует калькулятор доставки в корзине вашего клиента или при оформлении заказа. При оформлении заказа на этот товар покупателям не потребуется вводить сведения о доставке. <a href="https://woocommerce.com/document/managing-products/#adding-a-virtual-product" target="_blank" rel="noreferrer">Подробнее о виртуальных товарах</a>.','This report link has expired. %1$sClick here to view the filtered report%2$s.'=>'Срок действия этой ссылки на отчет истёк. %1$sЩёлкните здесь для просмотра отфильтрованного отчёта%2$s.','This resource cannot be created.'=>'Невозможно создать ресурс.','This sample language includes the basics around what personal data your store may be collecting, storing and sharing, as well as who may have access to that data. Depending on what settings are enabled and which additional plugins are used, the specific information shared by your store will vary. We recommend consulting with a lawyer when deciding what information to disclose on your privacy policy.'=>'Этот образец содержит основную информацию о том, какие персональные данные ваш магазин может собирать, хранить и передавать третьей стороне, а также о том, кто может получить доступ к этим данным. Информация относительно вашего магазина может отличаться в зависимости от вашего региона деятельности и используемых настроек и плагинов. Рекомендуем проконсультироваться с юристом о том, какие сведения следует раскрывать в вашей политике конфиденциальности.','This section controls the display of your website privacy policy. The privacy notices below will not show up unless a %s is set.'=>'В этом разделе можно настроить отображение политики конфиденциальности вашего сайта. Уведомления о защите конфиденциальной информации, приведённые ниже, не будут отображаться, если %s не настроена.','This section shows any files that are overriding the default WooCommerce template pages.'=>'Этот раздел показывает файлы, которые отличаются от шаблона WooCommerce по умолчанию.','This section shows details of Action Scheduler.'=>'В этом разделе показаны сведения о планировщике действий.','This section shows details of WC Admin.'=>'В этом разделе отображаются сведения об администраторе WC.','This section shows information about this status report.'=>'В этом разделе отображается информация об отчёте о состоянии.','This sets how many days log entries will be kept before being auto-deleted.'=>'Этот параметр определяет, сколько дней будут храниться записи журналов до автоматического удаления.','This sets the base page of your shop - this is where your product archive will be.'=>'Установка основной страницы вашего магазина — здесь будет располагаться архив товаров.','This sets the decimal separator of displayed prices.'=>'Устанавливает разделитель дробной части в отображаемых ценах.','This sets the minimum severity level of logs that will be stored. Lower severity levels will be ignored. "None" means all logs will be stored.'=>'Этот параметр определяет минимальный уровень серьёзности записей журнала, которые будут храниться. Записи журналов более низкого уровня серьёзности будут игнорироваться. «Нет» означает, что храниться будут все журналы.','This sets the number of decimal points shown in displayed prices.'=>'Определяет количество знаков после целого, в отображаемых ценах.','This sets the thousand separator of displayed prices.'=>'Определяет разделитель тысяч в отображаемых ценах.','This setting cannot be changed here because it is being set by a filter on the %s hook.'=>'Этот параметр невозможно изменить здесь, поскольку он определяется фильтром хука действия %s.','This setting cannot be changed here because it is defined in the %1$s constant, probably in your %2$s file.'=>'Этот параметр невозможно изменить здесь, поскольку он определён в константе %1$s, скорее всего в файле %2$s.','This setting cannot be changed here because it is defined in the %s constant.'=>'Этот параметр невозможно изменить здесь, поскольку он определён в константе %s.','This setting determines which shop pages products will be listed on.'=>'Эта настройка определяет, на каких страницах магазина будут отображены товары.','This setting does not apply to guest purchases.'=>'Эти настройки не применяются на гостевые покупки.','This setting only works when product data is stored in the posts table.'=>'Эта настройка действует, только если данные о товаре хранятся в таблице записей.','This shipping method does not have any settings to configure.'=>'Этот метод доставки не имеет настраиваемых параметров.','This subscription has expired. Contact the owner to <strong>renew</strong> the subscription to receive updates and support.'=>'Эта подписка истекла. Сообщите владельцу что нужно <strong>обновить</strong> подписку для дальнейшего получения обновлений и поддержки.','This subscription has expired. Please <strong>renew</strong> to receive updates and support.'=>'Эта подписка истекла. Пожалуйста <strong>обновите её</strong> чтобы и далее получать обновления и поддержку.','This subscription is expiring soon. Please <strong>renew</strong> to continue receiving updates and support.'=>'Срок действия этой подписки скоро закончится. <strong>Продлите</strong> её, чтобы и дальше получать обновления и поддержку.','This template has been overridden by your theme and can be found in: %s.'=>'Этот шаблон был переопределен вашей темой и может быть найден здесь: %s.','This text will appear in the footer of all of your WooCommerce emails.'=>'Этот текст будет отображаться в подвале всех электронных писем WooCommerce.','This text will be shown on the button linking to the external product.'=>'Будет отображён на кнопке, связанной с внешним товаром.','This tool allows you to generate and download a CSV file containing a list of all products.'=>'Этот инструмент позволяет сгенерировать (и скачать) CSV файл со списком всех товаров.','This tool allows you to generate and download a CSV file containing the selected products.'=>'Этот инструмент позволяет сгенерировать и скачать файл CSV со списком выбранных товаров.','This tool allows you to import (or merge) product data to your store from a CSV or TXT file.'=>'Этот инструмент позволяет импортировать (или дописывать) данные товаров из CSV или TXT файла к вашему магазину.','This tool will abort the regenerate product attributes lookup table regeneration. After this is done the process can be either started over, or resumed to continue where it stopped.'=>'Этот инструмент прервёт регенерацию таблицы обзора атрибутов товара. После этого процесс можно либо начать заново, либо возобновить, чтобы продолжить с того места, где он был прерван.','This tool will clear ALL expired transients from WordPress.'=>'Этот инструмент очищает WordPress от неактуальных временных данных.','This tool will clear the data from legacy order tables in WooCommerce.'=>'Этот инструмент удалит данные из устаревших таблиц заказов в WooCommerce.','This tool will clear the product/shop transients cache.'=>'Этот инструмент очистит кэш временных данных товаров/магазина.','This tool will delete all customer session data from the database, including current carts and saved carts in the database.'=>'Этот инструмент удаляет из базы данных всю информацию о сеансах пользователей, включая текущие и сохранённые корзины.','This tool will delete all variations which have no parent.'=>'Этот механизм удалит все вариации, не имеющие родительского товара.','This tool will delete expired download permissions and permissions with 0 remaining downloads.'=>'Этот инструмент удаляет разрешения, для которых истёк срок действия или не осталось доступных скачиваний.','This tool will empty the system status theme info cache.'=>'Этот инструмент очищает кеш данных о теме состояния системы.','This tool will empty the template cache.'=>'Этот инструмент позволяет очистить кэш шаблона.','This tool will empty the WooCommerce.com data cache, used in WooCommerce Extensions.'=>'Этот инструмент очистит кэш данных WooCommerce.com, используемый в расширениях WooCommerce.','This tool will generate the necessary Cost of Goods Sold (COGS) related columns in the product meta lookup table, and populate them from existing product data.'=>'Этот инструмент создаст необходимые столбцы, связанные с себестоимостью реализованных товаров (COGS), в колонках метаданных о товаре и заполнит их на основе имеющихся данных о товаре.','This tool will install all the missing WooCommerce pages. Pages already defined and set up will not be replaced.'=>'Эта служба установит все недостающие страницы WooCommerce. Ранее определенные и настроенные страницы не будут заменены.','This tool will recount product terms - useful when changing your settings in a way which hides products from the catalog.'=>'Этот инструмент пересчитает значения товаров — полезно при изменении настроек, в результате которых товары скрываются из каталога.','This tool will recreate the full text search index for order addresses. If the index does not exist, it will try to create it.'=>'Этот инструмент помогает воссоздать индекс полнотекстового поиска по адресам заказов. Если такого индекса нет, он пытается его создать.','This tool will regenerate product lookup table data. This process may take a while.'=>'Этот инструмент регенерирует данные таблицы обзора товара. Это может занять некоторое время.','This tool will regenerate the order fulfillment status for all orders and update the Analytics data using a direct SQL query.'=>'Этот инструмент восстановит статус выполнения заказа для всех заказов и обновит аналитические данные с помощью прямого SQL-запроса.','This tool will regenerate the product attributes lookup table data from existing product(s) data. This process may take a while.'=>'Этот механизм регенерирует данные таблицы обзора атрибутов товара из данных существующих товаров. Данный процесс может занять некоторое время.','This tool will remove the Cost of Goods Sold (COGS) related columns from the product meta lookup table. COGS will continue working (if the feature is enabled) but some functionality will not be available.'=>'Этот инструмент удалит колонки, связанные с себестоимостью проданных товаров (COGS), из таблицы метаданных о товаре. COGS продолжит работать (если эта функция включена), но некоторые функции будут недоступны.','This tool will repair the coupons lookup table data with missing discount amounts. This process may take a while.'=>'Исправление данных таблицы обзора купонов с пропущенными суммами скидок. Процесс может занять некоторое время.','This tool will reset the admin, customer and shop_manager roles to default. Use this if your users cannot access all of the WooCommerce admin pages.'=>'Этот инструмент сбросит параметры прав администратора, клиента и shop_manager. Используйте это, если пользователи не могут получить доступ к страницам управления WooCommerce.','This tool will reset the cached values used in WooCommerce Analytics. If numbers still look off, try %1$sReimporting Historical Data%2$s.'=>'Этот инструмент сбросит все кешированные значения из Аналитики WooCommerce. Если цифры все еще кажутся неверными, попробуйте %1$sзаново импортировать архивные данные%2$s.','This tool will resume the product attributes lookup table regeneration at the point in which it was aborted (%1$s products were already processed).'=>'Этот инструмент возобновит регенерацию таблицы обзора атрибутов товара с того момента, когда она была прервана (количество обработанных товаров: %1$s).','This tool will update your WooCommerce database to the latest version. Please ensure you make sufficient backups before proceeding.'=>'Это средство установит актуальную версию базы данных WooCommerce. Прежде чем продолжить, сделайте достаточное количество резервных копий.','This variation requires shipping or pickup'=>'Эта вариация требует доставки или самовывоза','This variation will not trigger your customer\'s shipping calculator in cart or at checkout. This product also won\'t require your customers to enter their shipping details at checkout. <a href="https://woocommerce.com/document/managing-products/#adding-a-virtual-product" target="_blank" rel="noreferrer">Read more about virtual products</a>.'=>'Этот вариант товара не активирует калькулятор доставки в корзине вашего клиента или при оформлении заказа. При оформлении заказа на этот товар покупателям не потребуется вводить сведения о доставке. <a href="https://woocommerce.com/document/managing-products/#adding-a-virtual-product" target="_blank" rel="noreferrer">Подробнее о виртуальных товарах</a>.','This video tutorial will help you go through the process of adding your first product in WooCommerce.'=>'Это обучающее видео поможет вам добавить в WooCommerce первый товар.','This webhook has the ⚠️ symbol in front of its name in the list below. Please either edit the webhook to use a different delivery format, or install and activate <a href="%s" target="_blank">the WooCommerce Legacy REST API extension</a>.'=>'Перед именем веб-перехватчика в приведённом ниже списке стоит значок ⚠️. Отредактируйте веб-перехватчик так, чтобы применялся другой формат доставки, либо установите и запустите <a href="%s" target="_blank">устаревшее расширение WooCommerce REST API</a>.' . "\0" . 'Перед именами веб-перехватчиков в приведённом ниже списке стоит значок ⚠️. Отредактируйте веб-перехватчики так, чтобы применялся другой формат доставки, либо установите и запустите <a href="%s" target="_blank">устаревшее расширение WooCommerce REST API</a>.' . "\0" . 'Перед именами веб-перехватчиков в приведённом ниже списке стоит значок ⚠️. Отредактируйте веб-перехватчики так, чтобы применялся другой формат доставки, либо установите и запустите <a href="%s" target="_blank">устаревшее расширение WooCommerce REST API</a>.','This webhook is configured to be delivered using the Legacy REST API, but the Legacy REST API plugin is not installed on this site.'=>'Этот веб-перехватчик настроен для доставки с использованием устаревшего REST API, однако устаревший плагин REST API не установлен на этом сайте.','This will be how your name will be displayed in the account section and in reviews'=>'Так ваше имя будет отображаться в разделе аккаунта и при публикации отзывов','This will change the stock status of all variations.'=>'Это приведет к изменению состояния запасов всех вариаций.','This will convert <code>coupon_data</code> order item meta entries to simplified <code>coupon_info</code> entries. The conversion will happen overtime in the background (via Action Scheduler). There are currently %d entries that can be converted.'=>'Это действие преобразует метазаписи элемента заказа <code>coupon_data</code> в упрощённые записи <code>coupon_info</code>. Преобразование будет производиться с течением времени в фоновом режиме (через планировщик действий). В настоящий момент имеются записи (%d), которые могут быть преобразованы.','This will convert <code>coupon_data</code> order item meta entries to simplified <code>coupon_info</code> entries. The conversion will happen overtime in the background (via Action Scheduler). There are currently no entries to convert.'=>'Это действие преобразует метазаписи элемента заказа <code>coupon_data</code> в упрощённые записи <code>coupon_info</code>. Преобразование будет производиться с течением времени в фоновом режиме (через планировщик действий). В настоящий момент нет записей для преобразования.','This will delete an inbox notification by slug'=>'Уведомление будет удалено по слагу','This will delete the custom orders tables. The tables can be deleted only if the "High-Performance order storage" is not authoritative and sync is disabled (via Settings > Advanced > Features).'=>'Это приведет к удалению таблиц пользовательских заказов. Таблицы можно удалить только в том случае, если «Высокопроизводительное хранилище заказов» не является авторитетным и синхронизация отключена (через Настройки > Дополнительно > Функции).','This will delete the custom orders tables. To create them again enable the "High-Performance order storage" feature (via Settings > Advanced > Features).'=>'Это приведёт к удалению таблиц заказов. Для их повторного создания, необходимо включить функцию "Высокопроизводительного хранилища заказов" (в разделе Настройки > Дополнительно > Функции).','This will give "%1$s" %2$s access which will allow it to:'=>'"%1$s" получит доступ уровня %2$s, который позволит:','This will refresh the remote inbox notifications'=>'Более давние уведомления будут обновлены','This will regenerate all shop thumbnails to match your theme and/or image settings.'=>'Это регенерирует все миниатюры магазина для соответствия параметрам темы сайта и/или настройкам изображений.','This will stop the background process that converts <code>coupon_data</code> order item meta entries to simplified <code>coupon_info</code> entries. There are currently %d entries that can be converted.'=>'Это вызовет остановку фонового процесса преобразования метазаписей элементов заказа <code>coupon_data</code> в упрощённые записи <code>coupon_info</code>. В настоящий момент имеются записи (%d), которые могут быть преобразованы.','Thiès'=>'Тиес','Thousand separator'=>'Разделитель тысяч','Thousand separator for the currency which can be used to format returned prices.'=>'Разделитель тысяч, который может использоваться для форматирования возвращаемых цен.','Thousand separator.'=>'Разделитель тысяч.','Thousands separator for displayed prices in this country.'=>'Разделитель тысяч для отображаемых цен в этой стране.','Thumbnail'=>'Миниатюра','Thumbnail cropping'=>'Обрезка миниатюры','Thumbnail image'=>'Миниатюра','Thumbnail regeneration has been scheduled to run in the background.'=>'Перегенерация миниатюр запланирована для запуска в фоновом режиме.','Thumbnail regeneration is running in the background. Depending on the amount of images in your store this may take a while.'=>'Перегенерация миниатюр происходит в фоновом режиме. В зависимости от количества изображений в вашем магазине эта операция может занять некоторое время.','Thumbnail sizes for responsive images.'=>'Миниатюры адаптивных изображений.','Thumbnail srcset for responsive images.'=>'Атрибут srcset миниатюр адаптивных изображений.','Thumbnail URL.'=>'URL-адрес миниатюры.','Thumbnail width'=>'Ширина миниатюры','Thurgau'=>'Тургау','Thuringia'=>'Тюрингия','Tianjin / 天津'=>'Тяньцзинь','Tiaret'=>'Тиарет','Tibet / 西藏'=>'Тибет','Ticino'=>'Тичино','Tierra del Fuego'=>'Огненная Земля','TikTok for WooCommerce'=>'TikTok для WooCommerce','Tilopay'=>'Tilopay','Time interval to use for buckets in the returned data.'=>'Интервал времени, используемый для сегментов в возвращаемых данных.','Time of payment:'=>'Время оплаты:','Time period to snooze the task.'=>'Срок откладывания задачи.','Timeless elegance'=>'Непреходящая элегантность','Timestamp'=>'Отметка времени','Timiș'=>'Тимиш','Timor-Leste'=>'Восточный Тимор','Tindouf'=>'Тиндуф','Tinghir'=>'Тингир','Tip: By suggesting complementary products in the cart using cross-sells, you can significantly increase the average order value.'=>'Подсказка. Предлагая сопутствующие товары в корзине при помощи перекрёстных продаж, вы можете существенно увеличить средний чек.','Tip: Upsells are products that are extra profitable or better quality or more expensive. Experiment with combinations to boost sales.'=>'Апсэлы – это более прибыльные, качественные или дорогие товары. Пробуйте различные комбинации, чтобы повысить продажи.','Tipasa'=>'Типаза','Tipperary'=>'Типперери','Tirana'=>'Тирана','Tissemsilt'=>'Тисамсил','Title'=>'Наименование','Title of the marketing campaign.'=>'Название маркетинговой кампании.','Title of the note.'=>'Название заметки.','Title of the payment method.'=>'Название способа оплаты.','Title of the settings group.'=>'Название группы настроек.','Title.'=>'Заголовок.','Title:'=>'Заголовок:','Tizi Ouzou'=>'Тизи-Узу','Tiznit'=>'Тизнит','Tlaxcala'=>'Тласкала','Tlemcen'=>'Тлемсен','To allow logging, make %s writable.'=>'Чтобы обеспечить условия для ведение журнала, сделайте %s доступным для записи.','To complete the sign-up process, customers must follow a verification link sent to their e-mail after submitting the sign-up form.'=>'Чтобы завершить процесс регистрации, клиенты должны переходить по ссылке, отправленной им на электронную почту после заполнения регистрационной формы.','To connect to %1$s you need to be logged in. Log in to your store below, or <a href="%2$s">cancel and return to %1$s</a>'=>'Для подключения %1$s вам нужно войти. Сделайте это ниже или <a href="%2$s">отмените и вернитесь к %1$s</a>','To edit this order change the status back to "Pending payment"'=>'Для правки этого заказа установите ему статус «В ожидании оплаты»','To enable this update you need to <strong>activate</strong> this subscription.'=>'Чтобы подключить это обновление, необходимо <strong>активировать</strong> эту подписку.','To enable this update you need to <strong>purchase</strong> a new subscription.'=>'Чтобы подключить это обновление, необходимо <strong>приобрести</strong> новую подписку.','To ensure your store&rsquo;s notifications arrive in your and your customers&rsquo; inboxes, we recommend connecting your email address to your domain and setting up a dedicated SMTP server. If something doesn&rsquo;t seem to be sending correctly, install the <a href="%1$s">WP Mail Logging Plugin</a> or check the <a href="%2$s">Email FAQ page</a>.'=>'Чтобы письма с уведомлениями магазина поступали вам и вашим клиентам, рекомендуем подключить адрес электронной почты к вашему домену и настроить выделенный SMTP-сервер. Если похоже, что сообщения не отправляются корректно, установите <a href="%1$s">плагин регистрации почты WP</a> или изучите <a href="%2$s">страницу часто задаваемых вопросов по электронной почте</а>.','To get started, <a href="%s" target="_blank">apply to ChatGPT</a>. Once approved, ChatGPT will provide the credentials below.'=>'Чтобы начать, <a href="%s" target="_blank">подайте заявку в ChatGPT</a>. После одобрения, ChatGPT предоставит указанные ниже учётные данные.','To make sure you never get that sinking "what did I forget" feeling, we\'ve put together the essential pre-launch checklist.'=>'Чтобы у вас не возникало чувство, что вы что-то забыли, мы составили контрольный список для проверки настроек перед запуском.','To manage your notifications, %s to log in to your account.'=>'Чтобы управлять своими уведомлениями, %s чтобы войти в свою учётную запись.','To manipulate product variations you should use the /products/&lt;product_id&gt;/variations/&lt;id&gt; endpoint.'=>'Для управления вариациями товаров нужно использовать эндпойнт /products/&lt;product_id&gt;/variations/&lt;id&gt;.','To offer local pickup, configure your pickup locations in the <a href=\'%s\'>local pickup settings</a>.'=>'Чтобы организовать самовывоз, настройте места получения заказов в <a href=\'%s\'>настройках самовывоза</a>.','To opt out, leave this box unticked. Your store remains untracked, and no data will be collected. Read about what usage data is tracked at: %s.'=>'При отключенной опции отслеживание не производится и данные не собираются. %s.','To override and edit this email template copy %1$s to your theme folder: %2$s.'=>'Чтобы переопределить и отредактировать этот шаблон письма, скопируйте %1$s в папку темы: %2$s.','To proceed, please consent to the creation of a new account with your e-mail.'=>'Чтобы продолжить, дайте согласие на создание новой учётной записи, указав свой адрес электронной почты.','To receive updates and support for this extension, you need to <strong>purchase</strong> a new subscription or consolidate your extensions to one connected account by <strong><a href="%1$s" title="Sharing Docs">sharing</a> or <a href="%2$s" title="Transferring Docs">transferring</a></strong> this extension to this connected account.'=>'Для получения обновлений и поддержки по этому расширению, вам требуется <strong>купить</strong> новую подписку, или объединить все расширения на одной учетной записи <strong><a href="%1$s" title="Документация по совместному использованию">совместного использования</a> или <a href="%2$s" title="Документация по переносу">перенести</a></strong> расширение на эту подключенную учетную запись.','To set your password, visit the following address: '=>'Чтобы установить пароль, перейдите по следующему адресу: ','To stop receiving these messages, %s to unsubscribe.'=>'Чтобы прекратить получать эти сообщения, %s чтобы отписаться.','To track your order please enter your Order ID in the box below and press the "Track" button. This was given to you on your receipt and in the confirmation email you should have received.'=>'Для отслеживания вашего заказа, пожалуйста, введите номер вашего заказа в поле ниже и нажмите кнопку "Отслеживание". Вы найдёте его в квитанции, которая была отправлена вам по электронной почте.','To view this page, you must either %1$slogin%2$s or verify the email address associated with the order.'=>'Чтобы просмотреть эту страницу, вам необходимо либо %1$sвойти%2$s, либо подтвердить адрес электронной почты, связанный с заказом.','Tocantins'=>'Токантинс','Tochigi'=>'Тотиги','Toggle &quot;Downloadable&quot;'=>'Переключить &quot;Скачив