data cannot be saved to session.'=>'WC_Session недоступен, данные клиента нельзя сохранить в сеансе.','We accept payments through PayPal. When processing payments, some of your data will be passed to PayPal, including information required to process or support the payment, such as the purchase total and billing information.'=>'Мы принимаем платежи через PayPal. При обработке платежа некоторые ваши данные передаются в PayPal. К ним относится информация, необходимая для обработки или выполнения платежа, например сведения об общей стоимости покупки и платёжные реквизиты.','We are unable to process your PayPal payment at this time. Please try again or use a different payment method.'=>'Ваш платёж не удаётся обработать через PayPal. Попробуйте ещё раз или используйте другой способ оплаты.','We collect information about you during the checkout process on our store.'=>'При оформлении заказа в нашем магазине мы собираем некоторые данные о вас.','We couldn\'t find a preview for this product.'=>'Не удалось найти предпросмотр этого товара.','We couldn\'t find a subscription for this product.'=>'Не удалось найти подписку на данный товар.','We encountered an SSL error. Please ensure your site supports TLS version 1.2 or above.'=>'Обнаружена ошибка SSL. Убедитесь, что ваш сайт поддерживает TLS версии 1.2 или выше.','We generally store information about you for as long as we need the information for the purposes for which we collect and use it, and we are not legally required to continue to keep it. For example, we will store order information for XXX years for tax and accounting purposes. This includes your name, email address and billing and shipping addresses.'=>'Обычно мы храним данные о вас столько, сколько необходимо для целей, ради которых мы их собираем и используем. Исключение составляют случаи, когда мы обязаны продолжать хранить эту информацию в связи с требованиями законодательства. Так, информация о заказе хранится у нас на протяжении XX лет, согласно правилам налогообложения и бухгалтерского учёта. К этим сведениям относится ваше имя, адрес электронной почты, адрес выставления счёта и адрес доставки.','We have created a sample draft Refund and Returns Policy page for you. Please have a look and update it to fit your store.'=>'Мы создали для вас образец страницы возврата. Пожалуйста, посмотрите и обновите его содержимое, чтобы оно соответствовало процессам вашей компании.','We have finished processing your order.'=>'Мы завершили обработку вашего заказа.','We hope they’ll be back soon! Read more about <a href="https://woocommerce.com/document/managing-orders/">troubleshooting failed payments</a>.'=>'Надеемся, они скоро вернутся! Подробнее о том, как <a href="https://woocommerce.com/document/managing-orders/">решать проблемы сбоя платежей</a>.','We hope to see you again soon.'=>'Надеемся вскоре снова вас увидеть.','We look forward to fulfilling your order soon.'=>'Надеемся скоро выполнить ваш заказ.','We look forward to seeing you soon.'=>'До скорой встречи.','We noticed that there was a problem during the Jetpack and WooCommerce Shipping & Tax install. Please try again and enjoy all the advantages of having the plugins connected to your store! Sorry for the inconvenience. The "Jetpack" and "WooCommerce Shipping & Tax" plugins will be installed & activated for free.'=>'Мы заметили, что во время установки плагинов Jetpack и WooCommerce Shipping & Tax возникла проблема. Повторите попытку и воспользуйтесь всеми преимуществами подключаемых плагинов для магазина! Извините за неудобства. Эти плагины будут установлены и активированы бесплатно.','We recently asked you if you wanted more information about WooPayments. Run your business and manage your payments in one place with the solution built and supported by WooCommerce.'=>'Недавно мы спросили вас, хотите ли вы получить больше информации о WooPayments. Запустите свой бизнес и управляйте платежами в одном месте с решением, построенным и поддерживаемым WooCommerce.','We recommend using ShipStation to save time at the post office by printing your shipping labels at home. Try ShipStation free for 30 days.'=>'Для экономии времени в процессе оформления посылок в почтовом отделении, рекомендуем напечатать транспортные этикетки дома, с помощью ShipStation. Используйте ShipStation бесплатно в течение 30 дней.','We share information with third parties who help us provide our orders and store services to you; for example --'=>'Мы делимся информацией с третьими лицами, которые помогают нам предоставлять вам наши заказы и услуги магазина; например -','We show contextual suggestions for official extensions that may be helpful to your store.'=>'WooCommerce предлагает контекстные рекомендации официальных расширений, которые могут пригодиться в вашем магазине.','We strongly recommend creating a backup of your site before updating.'=>'Настоятельно рекомендуем создать резервную копию сайта перед обновлением.','We use only the highest-quality materials in our products, ensuring that they look great and last for years to come.'=>'Мы производим товары только из материалов высшего качества. Это гарантирует, что они будут прекрасно выглядеть и через много лет.','We wanted to let you know that one of the previously fulfilled shipments from your order has been removed from our system. This may have been due to a correction or an update in our fulfillment records. Don’t worry — this won’t affect any items you’ve already received.'=>'Сообщаем, что одна из ранее выполненных доставок, входящих в ваш заказ, удалена из системы. Причиной могла быть корректировка или обновление записей о выполнении. Не беспокойтесь, это не затронет уже полученные вами позиции.','We were unable to process your order, please try again.'=>'Мы не смогли обработать ваш заказ. Пожалуйста, попробуйте ещё раз.','We were unable to verify the email address you provided. Please try again.'=>'Не удалось подтвердить указанный вами адрес электронной почты. Попробуйте ещё раз.','We will also store comments or reviews, if you choose to leave them.'=>'Также мы храним ваши комментарии и отзывы на товары.','We\'ll use %1$s for product weight and %2$s for product dimensions.'=>'Использовать %1$s для массы товара и %2$s для габаритов.','We\'re here for you — get tips, product updates, and inspiration straight to your mailbox.'=>'Мы рады помогать вам — получайте советы, информацию об обновлении товаров и вдохновляющие идеи прямо на почту.','We\'ve created two Shipping Zones - for %s and for the rest of the world. Below you can set Flat Rate shipping costs for these Zones or offer Free Shipping.'=>'Мы создали две зоны доставки - только %s и остальная часть мира. Ниже вы можете указать стоимость доставки по единой ставке для этих зон или предложить бесплатную доставку.','We\'ve made things simpler and easier to manage moving forward. From now on you can manage all your WooCommerce purchases directly from the Extensions menu within the WooCommerce plugin itself. <a href="%s">View and manage</a> your extensions now.'=>'Мы упростили всё, что могли, чтобы идти вперёд стало легче. Теперь вы сможете управлять всеми покупками в WooCommerce прямо из меню «Расширения» плагина WooCommerce. <a href="%s">Просмотреть и управлять</a> расширениями прямо сейчас.','Web admin'=>'Веб-администратор','Webhook actions'=>'Действия вебзацепа','Webhook created on %s'=>'Вебзацеп создан %s','Webhook created on date parsed by DateTime::formatM d, Y @ h:i A'=>'d.m.Y H:i','Webhook created successfully.'=>'Вебзацеп успешно создан.','Webhook data'=>'Данные вебзацепа','Webhook delivery URL must be a valid URL starting with http:// or https://.'=>'URL доставки вебзацепа должен начинаться с http:// или https://.','Webhook delivery URL.'=>'URL доставки вебзацепа.','Webhook event.'=>'Событие вебзацепа.','Webhook resource.'=>'Ресурс вебзацепа.','Webhook status must be valid.'=>'Статус вебзацепа должен быть корректным.','Webhook status.'=>'Статус вебзацепа.','Webhook topic is required and must be valid.'=>'Тема вебзацепа обязательна для заполнения.','Webhook topic must be valid.'=>'Тема вебзацепа должна быть валидной.','Webhook topic unknown. Please select a valid topic.'=>'Неизвестная тема вебзацепа. Выберите допустимую тему.','Webhook topic.'=>'Тема вебзацепа.','Webhook updated successfully.'=>'Вебзацеп обновлён.','Webhooks'=>'Вебзацепы','Webhooks are event notifications sent to URLs of your choice. They can be used to integrate with third-party services which support them.'=>'Вебзацепы - это уведомления о событиях, отправляемые на выбранные URL. С помощью вебзацепов можно интегрировать сторонние службы, которые их поддерживают.','Webhooks do not support trashing.'=>'Вебзацепы не поддерживают удаление в мусорку.','Week(s)'=>'Недели','Weight'=>'Вес','Weight (%s)'=>'Вес (%s)','Weight in decimal form'=>'Вес (не кратный килограмму) в виде десятичной дроби, c разделителем-точкой','Weight unit'=>'Единица веса','Welcome to'=>'Добро пожаловать в','Welcome to %s'=>'Добро пожаловать в %s','Welcome to the store'=>'Добро пожаловать в магазин','Welcome to {site_title}'=>'Добро пожаловать на {site_title}','Wellington'=>'Веллингтон','West African CFA franc'=>'Западноафриканский франк КФА','West Azarbaijan (آذربایجان غربی)'=>'Западный Азербайджан','West Bengal'=>'Западная Бенгалия','West Coast'=>'Уэст-Кост','West Greece'=>'Западная Греция','West Macedonia'=>'Западная Македония','West Panamá'=>'Западная Панама','West Pokot'=>'Западный Покот','West Virginia'=>'Западная Вирджиния','Western'=>'Западная','Western Australia'=>'Западная Австралия','Western Cape'=>'Западно-Капская провинция','Western North'=>'Северо-западная область','Western Sahara'=>'Западная Сахара','Westmeath'=>'Уэстмит','Westmoreland'=>'Уэстморленд','Wexford'=>'Уэксфорд','We’ll also use cookies to keep track of cart contents while you’re browsing our site.'=>'Также мы используем cookie для отслеживания того, что вы кладёте в корзину, пока находитесь на нашем сайте.','We’re getting in touch to let you know that order #%1$s from %2$s has been cancelled.'=>'Сообщаем вам, что заказ № %1$s от %2$s отменён.','We’re getting in touch to let you know that your order #%1$s has been cancelled.'=>'Пишем вам, чтобы сообщить, что ваш заказ № %1$s был отменён.','We’re having trouble connecting to WooCommerce.com'=>'Возникла проблема с подключением к WooCommerce.com','We’re sorry to let you know that your order #%1$s has been cancelled.'=>'С сожалением сообщаем, что ваш заказ № %1$s был отменён.','We’ve made some exciting improvements to our email templates, including modern, shopper-friendly designs and new customization options. And if you’re using a block theme, you can automatically sync your theme styles! Head to your email settings to explore the new features.'=>'Мы внесли несколько замечательных улучшений в наши шаблоны электронных писем, включая современный дизайн, удобный для покупателей, и новые возможности настройки. А если вы используете блочную тему, вы можете автоматически синхронизировать стили своих тем! Перейдите в настройки почты, чтобы ознакомиться с новыми функциями.','We’ve made some exciting improvements to your email templates, including modern, shopper-friendly designs and new customization options. And if you’re using a block theme, you can automatically sync your theme styles! Head to your email settings to explore the new changes.'=>'Мы внесли несколько замечательных улучшений в ваши шаблоны электронных писем, включая современный дизайн, удобный для покупателей, и новые возможности настройки. А если вы используете блочную тему, вы можете автоматически синхронизировать свои стили тем! Перейдите в настройки почты, чтобы ознакомиться с новыми изменениями.','We’ve received your order and it’s currently on hold until we can confirm your payment has been processed.'=>'Мы получили ваш заказ. Товар зарезервирован до подтверждения обработки платежа.','What currency do you accept payments in?'=>'В какой валюте вы принимаете платежи?','What currency prices are listed at in the catalog and which currency gateways will take payments in.'=>'В какой валюте выводятся цены в каталоге и в какой валюте платёжные шлюзы будут принимать оплату.','What fee do you want to charge for local delivery, disregarded if you choose free. Leave blank to disable.'=>'Какой сбор вы хотите назначить за местную доставку, проигнорируйте, если вы предоставляете бесплатную. Оставьте пустым для отключения.','What is PayPal?'=>'Что такое PayPal?','What makes this product unique? What are its most important features? Enrich the product page by adding rich content using blocks.'=>'Что делает этот товар уникальным? В чём его наиболее важные особенности? Насыщайте страницу товара, добавляя разнообразный контент с помощью блоков.','What our customers say'=>'Что говорят покупатели','What running the tool will do.'=>'Что делает служба при запуске.','What type of products do you plan to sell?'=>'Какого типа товары вы планируете продавать?','What we collect and store'=>'Какие данные мы собираем и храним','What we share with others'=>'Какие данные мы передаём третьим сторонам','What would you like to charge for flat rate shipping?'=>'Какой счёт вы желаете выставлять за доставку по единой ставке?','What ZIP/post codes are available for local delivery?'=>'Для каких почтовых индексов применима местная доставка?','What ZIP/post codes are available for local pickup?'=>'Для каких почтовых индексов допустим самовывоз?','When applying multiple coupons, apply the first coupon to the full price and the second coupon to the discounted price and so on.'=>'При использовании нескольких купонов, применять первый купон к полной стоимости, второй купон к уже сниженной и так далее.','When checked, customers will be able to purchase only 1 item in a single order. This is particularly useful for items that have limited quantity, like art or handmade goods.'=>'Клиенты смогут приобретать лишь один товар в одном заказе. Это особенно полезно для предметов, количество которых ограничено, таких как предметы искусства или изделия ручной работы.','When enabled, guests will be redirected to a login page to complete the sign-up process.'=>'Гости будут перенаправлены на страницу входа в систему для завершения процесса регистрации.','When enabled, PayPal will use the address provided by the checkout form, and prevent the buyer from changing it inside the PayPal payment page. Disable this to let buyers choose a shipping address from their PayPal account. PayPal verifies addresses therefore this setting can cause errors (we recommend keeping it disabled).'=>'PayPal будет использовать адрес, указанный в форме оформления заказа, и не позволит покупателю изменить его на странице оплаты PayPal. Отключите если нужно, чтобы покупатели могли выбрать адрес доставки из своей учетной записи PayPal. PayPal проверяет адреса, поэтому эта настройка может привести к ошибкам (рекомендуется оставить её отключенной).','When handling an %s, should access to downloadable files be revoked and download logs cleared?'=>'При обработке %s, должен ли доступ к скачиваемым файлам быть закрыт, а журналы скачивания очищены?','When handling an %s, should personal data within orders be retained or removed?'=>'При обработке %s, должны ли персональные данные по заказам быть сохранены или удалены?','When limiting response using after/before, which date column to compare against.'=>'При ограничении ответа с помощью параметра до/после укажите, с каким столбцом даты сравнивать.','When out of stock'=>'Когда нет в наличии','When product stock reaches this amount the stock status will change to "out of stock" and you will be notified via email. This setting does not affect existing "in stock" products.'=>'Когда количество товара в наличии дойдет до этой отметки, статус товара поменяется на «Нет в наличии» и вы получите уведомление на почту. Эта настройка не повлияет на товары, которые сейчас имеют статус «В наличии».','When product stock reaches this amount you will be notified by email. It is possible to define different values for each variation individually. The shop default value can be set in Settings > Products > Inventory.'=>'Когда запас товара достигнет этого количества, вы получите уведомление по электронной почте. Можно определить разные значения для каждой вариации индивидуально. Стандартное значение для всего магазина можно установить в разделе Настройки > Товары > Запасы.','When product stock reaches this amount you will be notified via email.'=>'Когда количество товара в наличии дойдет до этой отметки, вы получите уведомление на почту.','When the customer was last active in the site\'s timezone.'=>'Последняя активность клиента в часовом поясе сайта.','When the customer was last active, as GMT.'=>'Последняя активность клиента по Гринвичу (GMT).','When true, email a link to download the export to the requesting user.'=>'Если включено, отправляет ссылку на скачивание экспорта запрашивающему пользователю.','When true, refunded items are restocked.'=>'Если включено, возвращённые товары учитываются при рассчёте запасов.','When true, the payment gateway API is used to generate the refund.'=>'Если верно, возмещение производится через API-интерфейс платёжной системы.','When true, the payment gateway API is used to perform the refund. If the payment gateway does not support refunds, the refund will fail.'=>'Если значение равно «true», для возврата средств используется API платёжного шлюза. Если платёжный шлюз не поддерживает возврат средств, возврат не будет выполнен.','When variation stock reaches this amount you will be notified by email. The default value for all variations can be set in the product Inventory tab. The shop default value can be set in Settings > Products > Inventory.'=>'Когда запас вариации товара достигнет этого количества, вы получите уведомление по электронной почте. Стандартное значение для всех вариаций можно установить на вкладке запасов товара. Значение магазина по умолчанию можно установить в разделе Настройки > Товары > Запасы.','When viewing a brand archive, show the current brands description.'=>'При просмотре архива бренда отображается его текущее описание.','When you purchase from us, we’ll ask you to provide information including your name, billing address, shipping address, email address, phone number, credit card/payment details and optional account information like username and password. We’ll use this information for purposes, such as, to:'=>'Если вы захотите совершить у нас покупку, от вас потребуется предоставить сведения, включая ваше имя, адрес выставления счетов, адрес доставки, адрес электронной почты, номер телефона, данные банковской карты или платёжные реквизиты, а также дополнительные сведения аккаунта, такие как имя пользователя и пароль. Мы используем эти сведения в следующих целях:','When you receive a new order, it will appear here.'=>'Все новые заказы будут появляться здесь.','Where from in the onboarding flow this request was triggered.'=>'Откуда в процессе регистрации был запущен этот запрос.','Where is your store based?'=>'Где базируется ваш магазин?','Whether an order can be edited.'=>'Можно ли изменять заказ.','Whether an order needs payment, based on status and order total.'=>'Требуется ли оплата заказа на основании статуса и общей суммы заказа.','Whether an order needs processing before it can be completed.'=>'Требуется ли обработка заказа перед его выполнением.','Whether blueprint imports are currently allowed'=>'Разрешен ли импорт файлов Blueprint в данный момент','Whether onboarding is supported.'=>'Поддерживается ли адаптация.','Whether or not a user can request to be reminded about the note.'=>'Может ли пользователь запросить получение напоминаний о заметке.','Whether or not plugins step in core profiler was skipped.'=>'Был ли пропущен шаг плагинов в профилировщике ядра.','Whether or not the marketing channel is set up.'=>'Независимо от того, настроен маркетинговый канал или нет.','Whether or not the profile was completed.'=>'Был ли профиль заполнен.','Whether or not the profile was skipped.'=>'Определяет, пропускать ли профиль.','Whether or not this is a compound rate.'=>'Является ли данная ставка сложной.','Whether or not this store agreed to receiving marketing contents from WooCommerce.com.'=>'Согласился ли этот магазин на получение маркетинговых материалов от WooCommerce.com.','Whether or not this store country is set via onboarding profiler.'=>'Указана страна для этого магазина в мастере установки или нет.','Whether or not this tax rate also gets applied to shipping.'=>'Применяется ли эта налоговая ставка также к доставке.','Whether or not you have WordPress Multisite enabled.'=>'Включена ли мультисайтовость вашего WordPress\'а.','Whether the coupon grants free shipping or not.'=>'Предусматривает ли купон бесплатную доставку.','Whether the fulfillment is fulfilled.'=>'Выполнено ли выполнение.','Whether the onboarding process is completed.'=>'Завершён ли процесс адаптации пользователя.','Whether the onboarding process is in test mode.'=>'Проходит ли процесс регистрации в тестовом режиме.','Whether the onboarding process is started.'=>'Запущен ли процесс адаптации пользователя.','Whether the payment method should be recommended as enabled or not.'=>'Может этот способ оплаты быть рекомендован к включению или нет.','Whether the payment method should be required (and force-enabled) or not.'=>'Может этот способ оплаты быть обязательным (и принудительным) или нет.','Whether the plugin can only be activated network-wide.'=>'Может ли плагин быть активирован только по всей сети.','Whether the product is visible in the catalog'=>'Видимость товара в каталоге','Whether the provider has a payments processing account connected.'=>'Подключена ли у поставщика учётная запись для обработки платежей.','Whether the provider is enabled for use on checkout.'=>'Включён ли поставщик в процедуру оформления заказа.','Whether the provider is in dev mode. Having this true usually leads to forcing test payments. '=>'Находится ли поставщик в режиме разработки. Включение, как правило, инициирует принудительные тестовые платежи. ','Whether the provider is in test mode for payments processing.'=>'Находится ли поставщик в тестовом режиме обработки платежей.','Whether the provider needs setup.'=>'Нуждается ли поставщик в настройке.','Whether the shipping method is enabled.'=>'Включён ли способ доставки.','Whether this is a customer email.'=>'Является ли письмом клиента.','Whether this is sent only manually.'=>'Будет ли отправляться только вручную.','Whether to bypass trash and force deletion.'=>'Удалять навсегда, пропуская перемещение в мусорку.','Whether to consider GMT post dates when limiting response by published or modified date.'=>'Следует ли учитывать даты публикации по Гринвичу при ограничении ответа по дате публикации или изменения.','Whether to create a new user account as part of order processing.'=>'Нужно ли создать новую учетную запись пользователя в ходе обработки заказа.','Whether to generate a new catalog file regardless of whether a catalog file already exists.'=>'Создавать ли новый файл каталога независимо от факта его наличия.','Whether to hide resources not assigned to any products.'=>'Скрывать ли ресурсы, не относящиеся ни к одному из товаров.','Whether to notify the customer about the fulfillment update.'=>'Уведомлять ли клиента об обновлении выполнения.','Whether to update the billing email of the order, even if it already has one.'=>'Следует ли обновить адрес эл. почты для выставления счёта за заказ, даже если он уже указан.','Whether WooPayments is in dev mode.'=>'Находится ли WooPayments в режиме разработки.','Which columns should be exported?'=>'Какие столбцы должны быть экспортированы?','Which features are disabled?'=>'Какие функции отключены?','Which features are enabled?'=>'Какие функции включены?','Which product category should be exported?'=>'Какую категорию товаров нужно экспортировать?','Which product types should be exported?'=>'Какие типы товаров должны быть экспортированы?','While you visit our site, we’ll track:'=>'Когда вы посещаете наш сайт, мы сохраняем следующие сведения о вас:','Who on our team has access'=>'У каких членов команды магазина есть доступ','Wicklow'=>'Уиклоу','Width'=>'Ширина','Width (%s)'=>'Ширина (%s)','Wisconsin'=>'Висконсин','With a wide range of designer chairs to elevate your living space.'=>'Широкий выбор дизайнерских стульев, чтобы ваш дом выглядел элегантно.','with first and last resultShowing %1$d&ndash;%2$d of %3$d result'=>'Отображение %1$d&ndash;%2$d из %3$d' . "\0" . 'Отображение %1$d&ndash;%2$d из %3$d' . "\0" . 'Отображение %1$d&ndash;%2$d из %3$d','With our blocks, you can select and display products, categories, filters, and more virtually anywhere on your site — no need to use shortcodes or edit lines of code. Learn more about how to use each one of them.'=>'С помощью блоков можно отображать выбранные товары, категории, фильтры и другие элементы почти в любом месте сайта без шорткодов и изменения кода. Узнайте больше о том, как пользоваться каждым из них.','With the release of WooCommerce 4.0, these reports are being replaced. There is a new and better Analytics section available for users running WordPress 5.3+. Head on over to the <a href="%1$s">WooCommerce Analytics</a> or learn more about the new experience in the <a href="https://woocommerce.com/document/woocommerce-analytics/" target="_blank">WooCommerce Analytics documentation</a>.'=>'После выхода WooCommerce 4.0 эти отчёты больше не предоставляются. Теперь пользователям WordPress 5.3 и более поздних версий доступен новый, улучшенный раздел «Аналитика». Посетите раздел <a href="%1$s">WooCommerce Analytics</a> или ознакомьтесь подробнее с обновлениями в <a href="https://woocommerce.com/document/woocommerce-analytics/" target="_blank">документации по WooCommerce Analytics</a>.','With WooPayments, you can securely accept major cards, Apple Pay, and payments in over 100 currencies – with no setup costs or monthly fees – and you can now accept in-person payments with the Woo mobile app.'=>'Используя WooPayments, вы можете безопасно принимать карты основных платёжных систем, Apple Pay и оплату более чем в 100 валютах. Вам не потребуется платить за установку или ежемесячно оплачивать подписку. Кроме того, вы сможете принимать очные платежи с помощью мобильного приложения Woo.','With WooPayments, you can securely accept major cards, Apple Pay, and payments in over 100 currencies. Track cash flow and manage recurring revenue directly from your store’s dashboard - with no setup costs or monthly fees.'=>'Используя WooPayments, можно безопасно принимать оплату с карт основных платёжных систем и Apple Pay более чем в 100 валютах. Отслеживайте денежные потоки и управляйте регулярными поступлениями напрямую из панели администратора своего магазина. Платить за подключение и обслуживание не требуется.','Woo Email Content Pattern'=>'Паттерн контента письма Woo','Woo Email Template'=>'Шаблон письма Woo','Woo! Some items you purchased are being fulfilled. You can use the below information to track your shipment:'=>'Woo! Заказанные вами позиции выполняются. Вы можете использовать следующую информацию для отслеживания доставки:','WooCommerce'=>'WooCommerce','woocommerce'=>'woocommerce','WooCommerce %1$s table creation failed. Does the %2$s user have CREATE privileges on the %3$s database?'=>'Сбой создания таблицы %1$s WooCommerce. Есть ли у пользователя %2$s права на СОЗДАНИЕ в базе данных %3$s?','WooCommerce &rsaquo; Setup Wizard'=>'WooCommerce &rsaquo; Помощник установки','WooCommerce action names associated with the webhook.'=>'Названия действий WooCommerce, связанных с этим вебзацепом.','WooCommerce Admin'=>'WooCommerce Admin','WooCommerce Admin has been disabled'=>'WooCommerce Admin отключен','WooCommerce Admin icon'=>'Значок WooCommerce Admin','WooCommerce API. Use a consumer key in the username field and a consumer secret in the password field.'=>'WooCommerce API. Указывайте пользовательский ключ в поле имени пользователя, а секретный 