апрос.','You are paying for a guest order. Please continue with payment only if you recognize this order.'=>'Вы платите за заказ гостя. Продолжайте оплату, только если вы знаете про этот заказ.','You are viewing active plugins that are incompatible with currently enabled WooCommerce features.'=>'Вы просматриваете активные плагины, не совместимые с активированными на данный момент функциями WooCommerce.','You are viewing the active plugins that are incompatible with the \'%s\' feature.'=>'Вы просматриваете активные плагины, не совместимые с функцией «%s».','You attempted to edit an order that does not exist. Perhaps it was deleted?'=>'Попытка изменить несуществующий заказ. Может быть, она удалена?','You can access to more details of your order by visiting <a href="%s" target="_blank">My Account > Orders</a> and select the order you wish to see the latest status of the delivery.'=>'Подробную информацию о заказе ищите в разделе <a href="%s" target="_blank">Мой аккаунт > Заказы</a>.','You can access to more details of your order by visiting My Account > Orders and select the order you wish to see the latest status of the delivery.'=>'Чтобы просмотреть более подробные сведения о заказе, перейдите в раздел «Моя учётная запись > Заказы» и выберите заказ, статус доставки которого вы хотите узнать.','You can access your account area to view orders, change your password, and more via the link below:'=>'По ссылке ниже вы можете перейти в свою учётную запись, чтобы просматривать заказы, изменять пароль и выполнять другие действия.','You can add multiple shipping methods within this zone. Only customers within the zone will see them.'=>'Вы можете добавить несколько способов доставки в пределах этой зоны. Только клиенты в пределах зоны будут видеть их.','You can also:'=>'Вы также можете:','You can manually run queued updates here.'=>'Вы можете вручную запустить обновления из очереди здесь.','You can now %1$sview your recent orders%4$s, manage your %2$sshipping and billing addresses%4$s, and edit your %3$spassword and account details%4$s.'=>'Теперь вы можете %1$sпросматривать недавние заказы%4$s, редактировать %2$sплатёжный адрес и адрес доставки%4$s, а также изменять %3$sпароль и данные учётной записи%4$s.','You can only have 1 %s in your cart.'=>'В корзину можно положить только 1 %s.','You can specify a <a href="#" class="switch-to-general-tab">default value</a> for all variations'=>'Можно указать <a href="#" class="switch-to-general-tab">значение по умолчанию</a> для всех вариантов','You can switch order data storage <strong>only when the posts and orders tables are in sync</strong>. There are currently orders out of sync.'=>'Хранилище данных заказов можно изменить, <strong>только когда таблицы записей и заказов синхронизированы</strong>. Имеются несинхронизированные заказы.','You cannot add &quot;%s&quot; to the cart because the product is out of stock.'=>'Вы не можете добавить &quot;%s&quot; в корзину, так как этого товара нет в наличии.','You cannot add &quot;%s&quot; with a quantity less than or equal to 0 to the cart.'=>'Добавить в корзину «%s» с количеством, меньшим или равным 0 невозможно.','You cannot add a new payment method so soon after the previous one. Please wait for %d second.'=>'Вы не можете добавить новый способ оплаты сразу после добавления предыдущего. Подождите %d сек.' . "\0" . 'Вы не можете добавить новый способ оплаты сразу после добавления предыдущего. Подождите %d сек.' . "\0" . 'Вы не можете добавить новый способ оплаты сразу после добавления предыдущего. Подождите %d сек.','You cannot add another "%s" to your cart.'=>'Вы не можете добавить «%s» в корзину ещё раз.','You cannot add that amount of &quot;%1$s&quot; to the cart because there is not enough stock (%2$s remaining).'=>'Невозможно приобрести &quot;%1$s&quot; в таком количестве, так как запасы данного товара ограничены (осталось %2$s).','You cannot add that amount to the cart &mdash; we have %1$s in stock and you already have %2$s in your cart.'=>'Вы не можете добавить это количество в корзину &mdash; у нас в наличии %1$s, у вас в корзине уже %2$s.','You cannot add the same tax rate twice!'=>'Вы не можете применить одну и ту же налоговую ставку дважды!','You cannot edit this item because it is in the Trash. Please restore it and try again.'=>'Невозможно изменить этот элемент, так как он находится в корзине. Восстановите его и повторите попытку.','You created %s'=>'Вы создали магазин %s','You do not have permission to access this page'=>'У вас недостаточно прав для доступа к этой странице','You do not have permission to assign API Keys to the selected user.'=>'У вас недостаточно прав для передачи API-ключей выбранному пользователю.','You do not have permission to edit API Keys'=>'У вас недостаточно прав для редактирование ключей API','You do not have permission to edit this API Key'=>'У вас недостаточно прав для редактирования этого ключа API','You do not have permission to edit this order.'=>'У вас нет прав на редактирование этого заказа.','You do not have permission to edit Webhooks'=>'У вас нет прав для редактирования вебзацепов','You do not have permission to install plugins.'=>'У вас недостаточно прав для установки плагинов.','You do not have permission to manage log entries.'=>'У вас нет прав на управление записями журнала.','You do not have permission to manage log files.'=>'У вас нет прав на управление файлами журнала.','You do not have permission to manage logging settings.'=>'У вас нет прав на управление настройками ведения журнала.','You do not have permission to modify the list of approved directories for product downloads.'=>'Вы не можете изменять список разрешенных директорий для скачивания товаров.','You do not have permission to revoke API Keys'=>'У вас недостаточно прав для отзыва ключей API','You do not have permission to revoke this API Key'=>'У вас недостаточно прав для отзыва этого ключа API','You do not have permission to save settings.'=>'У вас нет разрешения на сохранение настроек.','You do not have permission to update Webhooks'=>'У вас нет прав для создания вебзацепов','You don&#8217;t have permission to do this.'=>'У вас нет прав на выполнение этого действия.','You don\'t have a subscription for <strong>%1$s</strong>. Subscribe to receive updates and streamlined support.'=>'У вас нет подписки на <strong>%1$s</strong>. Оформите подписку, чтобы получать обновления и регулярную поддержку.','You don\'t have permission to create a new order.'=>'У Вас нет разрешения на создание нового заказа.','You don\'t have subscriptions for <strong>%1$s Woo extensions</strong>. Subscribe to receive updates and streamlined support.'=>'У вас нет подписок на <strong>%1$s Woo extensions</strong>. Оформите подписку, чтобы получать обновления и регулярную поддержку.','You have <strong>%1$s Woo extension subscriptions</strong> expiring soon. <a href="%2$s">Enable auto-renewal</a> to continue receiving updates and streamlined support.'=>'У вас есть <strong>подписки на расширение Woo (%1$s)</strong>, чей срок скоро истекает. <a href="%2$s">Включите автоматическое продление</a>, чтобы и дальше получать обновления и улучшенную поддержку.','You have <strong>%1$s Woo extension subscriptions</strong> that expired. <a href="%2$s">Renew</a> to continue receiving updates and streamlined support.'=>'У вас есть <strong>подписки на расширение Woo (%1$s)</strong> с истекшим сроком. <a href="%2$s">Продлите их</a>, чтобы и дальше получать обновления и улучшенную поддержку.','You have already joined the waitlist! Click {manage_account_link} to manage your notifications.'=>'Вы уже присоединились к списку ожидания! Нажмите {manage_account_link}, чтобы управлять своими уведомлениями.','You have already joined this waitlist.'=>'Вы уже находитесь в этом списке ожидания.','You have already joined this waitlist. Please complete the sign-up process by following the verification link sent to your e-mail.'=>'Вы уже находитесь в этом списке ожидания. Для завершения процесса регистрации, перейдите по ссылке, отправленной на ваш электронный адрес.','You have already signed up too many times. Please try again later.'=>'Вы регистрировались слишком много раз. Повторите попытку позже.','You have attempted to register a duplicate form %1$s with WooCommerce Form: %2$s'=>'Вы пытались зарегистрировать дубликат формы %1$s с помощью формы WooCommerce: %2$s','You have exceeded the request limit. Please try again after a few minutes.'=>'Вы превысили лимит запросов. Повторите попытку через несколько минут.','You have installed a development version of WooCommerce which requires files to be built and minified. From the plugin directory, run <code>pnpm install</code> and then <code>pnpm --filter=\'@woocommerce/plugin-woocommerce\' build</code> to build and minify assets.'=>'Вы установили версию WooCommerce для разработчиков, которая требует сборки и минификации файлов. Из директории плагина запустите <code>pnpm install</code>, а затем <code>pnpm --filter=\'@woocommerce/plugin-woocommerce\' build</code> для сборки и минификации ассетов.','You have joined the "{product_name}" waitlist.'=>'Вы присоединились к списку ожидания «{product_name}».','You have not set up this type of address yet.'=>'Вы ещё не настроили этот тип адреса.','You have received the following WooCommerce log message:'=>'Вы получили сообщение журнала WooCommerce:' . "\0" . 'Вы получили сообщения журнала WooCommerce:' . "\0" . 'Вы получили сообщения журнала WooCommerce:','You have received this message because your e-mail address was used to sign up for stock notifications on our store.'=>'Вы получили это сообщение, потому что ваш адрес электронной почты был использован для подписки на уведомления о наличии товара в нашем магазине.','You have received this message because your e-mail address was used to sign up for stock notifications on our store. Wasn\'t you? Please get in touch with us if you keep receiving these messages.'=>'Вы получили это сообщение, потому что ваш адрес электронной почты был использован для подписки на уведомления о распродажах в нашем магазине. Пожалуйста, свяжитесь с нами, если вы продолжите получать подобные сообщения.','You have successfully connected your store to WooCommerce.com'=>'Ваш магазин подключён к WooCommerce.com','You have successfully disconnected your store from WooCommerce.com'=>'Ваш магазин отключён от WooCommerce.com','You have successfully signed up and will be notified when "%s" is back in stock! Note that a new account has been created for you; please check your e-mail for details.'=>'Вы успешно зарегистрированы и получите уведомление, когда «%s» снова будет в наличии! Для вас создана новая учётная запись, проверьте свой Email для получения подробной информации.','You have successfully signed up! You will be notified when "%s" is back in stock.'=>'Вы успешно зарегистрировались! Вы будете уведомлены, когда «%s» снова будет в наличии.','You have used this coupon %s in another transaction during this checkout, and coupon usage limit is reached. Please remove the coupon and try again.'=>'Вы применили этот купон %s в другой транзакции при оформления заказа. Достигнут лимит применения купона. Удалите купон и повторите попытку.','You may also like&hellip;'=>'Вам также будет интересно&hellip;','You may be interested in&hellip;'=>'Вас также может заинтересовать&hellip;','You may be interested in…'=>'Вас может заинтересовать…','You may need to manually restore the item\'s stock.'=>'Вам может потребоваться вручную восстановить количество по этой позиции на складе.','You may want to switch to the database for log storage.'=>'Возможно, вы захотите переключиться на базу данных для хранения журнала.','You must be %1$slogged in%2$s to post a review.'=>'Для отправки отзыва вам необходимо %1$sавторизоваться%2$s.','You must be logged in to checkout.'=>'Вам необходимо авторизоваться для оформления заказа.','You must be logged in to download files.'=>'Вам необходимо авторизоваться для скачивания файлов.','You must enter a valid license key on the <a href="%1$s">MaxMind integration settings page</a> in order to use the geolocation service. If you do not need geolocation for shipping or taxes, you should change the default customer location on the <a href="%2$s">general settings page</a>.'=>'Чтобы использовать службу определения местоположения, необходимо ввести действительный лицензионный ключ на <a href="%1$s">странице настроек интеграции MaxMind</a>. Если вам не требуется определять местоположение для доставки или расчета налогов, измените местоположение клиента по умолчанию на <a href="%2$s">странице общих настроек</a>.','You must supply an array of options and values.'=>'Вы должны предоставить массив параметров и значений.','You must supply an array of options.'=>'Вы должны предоставить массив параметров.','You need WooCommerce 4.2 or newer to run this tool.'=>'Чтобы запустить этот инструмент, необходимо решение WooCommerce 4.2 или более новой версии.','You want your product catalog and images to look great and align with your brand. This guide will give you all the tips you need to get your products looking great in your store.'=>'Вы хотите, чтобы ваш каталог товаров с изображениями выглядели великолепно и соответствовали вашему бренду. Это руководство даст вам все необходимые советы, чтобы ваши товары отлично смотрелись в вашем магазине.','You will need to manually issue a refund through your payment gateway after using this.'=>'Вам будет нужно вручную выдать возврат через соответствующий платёжный шлюз после этого.','You\'re almost there! Once you complete store setup you can start receiving orders.'=>'Вы почти там! После завершения настройки магазина вы сможете начать получать заказы.','You\'re invited to share your experience'=>'Приглашаем вас поделиться опытом','You\'re only one step away from getting paid. Verify your business details to start managing transactions with WooPayments.'=>'Остался один шаг до начала приёма платежей. Проверьте сведения о вашей компании, чтобы начать управлять транзакциями с помощью WooPayments.','You\'re ready to add products to your store.'=>'Теперь вы можете добавить товары в свой магазин.','You\'re ready to start selling!'=>'Вы готовы к старту продаж!','You\'ve hit the 10 orders milestone! Look at you go. Browse some WooCommerce success stories for inspiration.'=>'Вы достигли уровня в 10 заказов! Посмотрите на свой прогресс. Для мотивации просмотрите некоторые истории успеха пользователей WooCommerce.','Your %1$s order #%2$s has been partially refunded'=>'Ваш заказ № %2$s на %1$s был частично возвращён','Your %1$s order #%2$s has been refunded'=>'Ваш заказ № %2$s на %1$s был возвращён','Your account has been successfully created'=>'Ваша учётная запись успешно создана.','Your account was created successfully and a password has been sent to your email address.'=>'Учетная запись создана, пароль отправлен на ваш адрес электронной почты.','Your account was created successfully. Your login details have been sent to your email address.'=>'Ваша учетная запись создана. Данные для входа отправлены на ваш адрес электронной почты.','Your account with %s is using a temporary password. We emailed you a link to change your password.'=>'В вашей учетной записи на %s используется временный пароль. Вам по электронной почте отправлена ссылка для смены пароля.','Your cart'=>'Ваша корзина','Your cart is currently empty!'=>'Сейчас ваша корзина пуста!','Your cart is currently empty.'=>'Ваша корзина пока пуста.','Your changed data will be lost if you leave this page without saving.'=>'Изменённые вами данные будут утеряны, если вы покинете эту страницу без сохранения.','Your changes have been saved.'=>'Ваши изменения сохранены.','Your changes were not saved. Please retry.'=>'Не удалось сохранить изменения. Попробуйте снова.','Your CSV needs to include columns in a specific order. %1$sClick here to download a sample%2$s.'=>'Ваш CSV должен включать столбцы в определенном порядке. %1$sНажмите для скачивания примера%2$s.','Your current password is incorrect.'=>'Ваш текущий пароль неверен.','Your customers will see the name of this shipping method during checkout.'=>'Ваши клиенты увидят название этого способа доставки во время оформления заказа.','Your in-store purchase #%1$s at %2$s'=>'Ваш заказ № %1$s на %2$s','Your installation of WooCommerce is incomplete. If you installed WooCommerce from GitHub, %1$splease refer to this document%2$s to set up your development environment.'=>'Ваша установка WooCommerce неполная. Если вы скачали WooCommerce из GitHub, пожалуйста, следуйте %1$sэтой инструкции%2$s по настройке среды разработки.','Your installation of WooCommerce is incomplete. If you installed WooCommerce from GitHub, please refer to this document to set up your development environment: https://github.com/woocommerce/woocommerce/wiki/How-to-set-up-WooCommerce-development-environment'=>'Ваша установка WooCommerce неполная. Если вы скачали WooCommerce из GitHub, пожалуйста следуйте этой инструкции по настройке среды разработки: https://github.com/woocommerce/woocommerce/wiki/How-to-set-up-WooCommerce-development-environment','Your item is on the way!'=>'Ваш товар уже в пути!','Your order'=>'Ваш заказ','Your order #%s has been cancelled.'=>'Ваш заказ № %s был отменён.','Your order at {site_title} was unsuccessful'=>'К сожалению, ваш заказ в {site_title} отменён','Your order can no longer be cancelled. Please contact us if you need assistance.'=>'Ваш заказ не может быть отменен. Пожалуйста, свяжитесь с нами, если вам нужна помощь.','Your order cannot be processed as the originating bank/merchant has declined your transaction. Please attempt your purchase again.'=>'Ваш заказ не может быть обработан, поскольку банк/продавец отклонил вашу транзакцию. Пожалуйста, повторите попытку опофрмления покупки.','Your order details are as follows:'=>'Сведения о вашем заказе:','Your order from %s has been partially refunded.'=>'Вам частично возвращены денежные средства за заказ у %s.','Your order from %s has been refunded.'=>'Вам возвращены денежные средства за заказ у %s.','Your order from {site_title} is on its way!'=>'Ваш заказ от {site_title} уже в пути!','Your order has been cancelled.'=>'Ваш заказ был отменён.','Your order on %s has been partially refunded. There are more details below for your reference:'=>'Для вашего заказа на %s частично возвращены денежные средства. См. ниже дополнительную информацию для справки:','Your order on %s has been refunded. There are more details below for your reference:'=>'Для вашего заказа на %s возвращены денежные средства. См. ниже дополнительную информацию для справки:','Your order was cancelled.'=>'Ваш заказ отменен.','Your order was refunded %s.'=>'Ваш заказ был возвращён %s.','Your password has been reset successfully.'=>'Ваш пароль успешно сброшен.','Your PayPal account has been restricted by PayPal. This may prevent customers from completing payments. Please %1$scontact PayPal support%2$s to resolve this issue and restore full functionality to your account.'=>'Ваш PayPal аккаунт был ограничен PayPal. Это может помешать клиентам завершать платежи. Пожалуйста, %1$sобратитесь в службу поддержки PayPal%2$s, чтобы решить эту проблему и восстановить полную функциональность вашего аккаунта.','Your personal data will be used to process your order, support your experience throughout this website, and for other purposes described in our %s.'=>'Ваши персональные данные будут использоваться для обработки ваших заказов, упрощения вашего взаимодействия с сайтом и для прочих целей, которые описывает наша %s.','Your personal data will be used to support your experience throughout this website, to manage access to your account, and for other purposes described in our %s.'=>'Ваши персональные данные будут использоваться для упрощения вашего дальнейшего взаимодействия с сайтом, управления доступом к вашему аккаунту и для прочих целей, которые описывает наша %s.','Your products are now being imported...'=>'Ваши товары сейчас импортируются...','Your rating'=>'Ваша оценка','Your Report Download'=>'Загрузка вашего отчёта','Your report file is being generated.'=>'Формируется файл вашего отчёта.','Your review'=>'Ваш отзыв','Your review is awaiting approval'=>'Ваш комментарий ожидает одобрения','Your review is awaiting moderation.'=>'Ваш отзыв ожидает проверки.','Your review is awaiting moderation. This is a preview; your review will be visible after it has been approved.'=>'Ваш отзыв ожидает проверки. Это предварительный просмотр. Ваш отзыв будет опубликован после утверждения.','Your selection has been reset. Please select some product options before adding this product to your cart.'=>'Результаты вашего выбора сброшены. Выберите опции товара, перед тем как добавить его в корзину.','Your server does not have fsockopen or cURL enabled - PayPal IPN and other scripts which communicate with other servers will not work. Contact your hosting provider.'=>'Ваш сервер не имеет включенных fsockopen или cURL — PayPal IPN и другие скрипты, которые связываются с другими серверами, не будут работать. Свяжитесь со своим хостинг провайдером.','Your server does not have the %s class enabled - HTML/Multipart emails, and also some extensions, will not work without DOMDocument.'=>'На вашем сервере не обнаружен установленный класс %s, без DOMDocument не работают электронные письма HTML/Multipart и некоторые расширения.','Your server does not have the %s class enabled - some gateway plugins which use SOAP may not work as expected.'=>'На вашем сервере не включён класс %s - некоторые плагины шлюзов, использующие SOAP могут не работать как ожидалось.','Your server does not support the %s function - this is required to use the GeoIP database from MaxMind.'=>'Ваш сервер не поддерживает функцию %s - она необходима для использования базы данных GeoIP от MaxMind.','Your server does not support the %s functions - this is required for better character encoding. Some fallbacks will be used instead for it.'=>'Ваш сервер не поддерживает функции %s - это необходимо для лучшего кодирования символов. Некоторые откаты будут использованы вместо этого.','Your settings have been saved.'=>'Ваши настройки сохранены.','Your shipment has been updated'=>'Доставка обновлена','Your site is currently connected to WooCommerce.com using <b>%1$s</b>, but your actual site URL is <b>%2$s</b>. To fix this, please reconnect your site to <b>WooCommerce.com</b> to ensure everything works correctly.'=>'В настоящее время ваш сайт подключен к WooCommerce.com с помощью <b>%1$s</b>, но фактический URL-адрес вашего сайта — <b>%2$s</b>. Чтобы решить эту проблему, переподключите свой сайт к <b>WooCommerce.com</b> и убедитесь, что всё работает правильно.','Your site might be on a private network. Jetpack can only connect to public sites. Please make sure your site is visible over the internet, and then try connecting again 🙏.'=>'Ваш сайт, возможно, находится в частной сети. Jetpack может подключаться только к общедоступным сайтам. Убедитесь, что ваш сайт доступен из Интернета, и попытайтесь подключиться снова 🙏.','Your store address is required to set the origin country for shipping, currencies, and payment options.'=>'Адрес магазина необходим, чтобы установить страну для настройки доставки, валюты и платежей.','Your store contact email.'=>'Адрес электронной почты для связи с вашим магазином.','Your store does not appear to be using a secure connection. We highly recommend serving your entire website over an HTTPS connection to help keep customer data secure. <a href="%s">Learn more here.</a>'=>'Похоже, ваш магазин не использует защищённое соединение. Настоятельно рекомендуем настроить доступ ко всему вашему сайту через HTTPS-соединение, чтобы защитить данные клиентов. <a href="%s">Читайте об этом здесь.</a>','Your store emails have had an upgrade!'=>'Ваши письма от магазина были обновлены!','Your store is almost ready! To activate services like %s, just connect with Jetpack.'=>'Ваш магазин почти готов! Чтобы активировать сервисы, как %s, просто подключите Jetpack.','Your store is already connected.'=>'Ваш магазин уже подключён.','Your store is configured to serve digital products using "Redirect only" method. This method is deprecated, <a href="%s">please switch to a different method instead.</a><br><em>If you use a remote server for downloadable files (such as Google Drive, Dropbox, Amazon S3), you may optionally wish to "allow using redirects as a last resort". Enabling that and/or selecting any of the other options will make this notice go away.</em>'=>'Ваш магазин настроен для размещения цифровых товаров методом «только переадресация». Этот метод устарел, <a href="%s">вам необходимо переключиться на другой метод</a>.<br><em>Если вы используете отдалённый сервер для скачивания файлов (например, Google Диск, Dropbox, Amazon S3), при желании вы можете «разрешить использование переадресации в крайнем случае». При включении этого параметра и/или выборе любого другого параметра это уведомление исчезнет.</em>','Your store is not connected to WooCommerce.com. Run `wp wc com connect` command.'=>'Ваш магазин не подключен к WooCommerce.com. Запустите следующую команду: wp wc com connect.','Your store is not using HTTPS. <a href="%s" target="_blank">Learn more about HTTPS and SSL Certificates</a>.'=>'В вашем магазине не используется HTTPS. <a href="%s" target="_blank">Подробнее об HTTPS и SSL-сертификатах</a>.','Your store is using shortcode checkout. Use the Checkout blocks to activate this option.'=>'В вашем магазине действует оформление заказов по шорткодам. Чтобы включить эту опцию, воспользуйтесь блоками «Оформление заказа».','Your store might be at risk as you are running old versions of WooCommerce plugins.'=>'Ваш магазин может оказаться в опасности, так как вы используете устаревшие версии плагинов WooCommerce.','Your store\'s uploads directory is <a href="%1$s">browsable via the web</a>. We strongly recommend <a href="%2$s">configuring your web server to prevent directory indexing</a>.'=>'Каталог загрузок магазина <a href="%1$s">открыт для просмотра в Интернете</a>. Мы настоятельно рекомендуем <a href="%2$s">настроить на веб-сервере блокировку индексации каталога</a>.','Your subscription expired on %s. Get a new subscription to continue receiving updates and access to support.'=>'Срок действия вашей подписки истек %s. Получите новую подписку, чтобы продолжить получать обновления и доступ к поддержке.','Your subscription expires in %d days. Enable autorenew to avoid losing updates and access to support.'=>'Срок действия вашей подписки истекает через %d дней. Включите автообновление, чтобы избежать потери обновлений и доступа к поддержке.','Your subscription for <strong>%1$s</strong> expired. <a href="%3$s">%4$s</a> to continue receiving updates and streamlined support.'=>'Срок подписки на <strong>%1$s</strong> истёк. <a href="%3$s">%4$s</a>, чтобы продолжать получать обновления и улучшенную поддержку.','Your subscription for <strong>%1$s</strong> expires on %2$s. <a href="%3$s">Enable auto-renewal</a> to continue receiving updates and streamlined support.'=>'Срок действия подписки на <strong>%1$s</strong> истекает %2$s. <a href="%3$s">Включите автоматическое продление</a>, чтобы и дальше получать обновления и улучшенную поддержку.','Your subscription has been connected.'=>'Ваша подписка подключена.','Your subscription has been disconnected.'=>'Ваша подписка отключена.','Your theme has a woocommerce.php file, you will not be able to override the woocommerce/archive-product.php custom template since woocommerce.php has priority over archive-product.php. This is intended to prevent display issues.'=>'В вашей теме содержится файл woocommerce.php, вы не сможете переопределить кастомный шаблон woocommerce/archive-product.php с тех пор, как woocommerce.php получил приоритет над archive-product.php. Это предотвращает проблемы с отображением.','Your trusted payments partner in Asia and around the world.'=>'Ваш доверенный платёжный партнёр в Азии и по всему миру.','Your WooCommerce extension subscription is missing a payment method for renewal. <a href="%s">Add a payment method</a> to ensure you continue receiving updates and streamlined support.'=>'В вашей подписке на расширение WooCommerce не указан способ оплаты для продления. <a href="%s">Добавьте способ оплаты</a>, чтобы продолжить получать обновления и оптимизированную поддержку.' . "\0" . 'В ваших подписках на расширение WooCommerce не указан способ оплаты для продления. <a href="%s">Добавьте способ оплаты</a>, чтобы продолжить получать обновления и оптимизированную поддержку.' . "\0" . 'В ваших подписках на расширение WooCommerce не указан способ оплаты для продления. <a href="%s">Добавьте способ оплаты</a>, чтобы продолжить получать обновления и оптимизированную поддержку.','Your WooCommerce extension subscription is missing a payment method for renewal. Add a payment method to ensure you continue receiving updates and streamlined support.'=>'В вашей подписке на расширение WooCommerce не указан способ оплаты для продления. Добавьте способ оплаты, чтобы продолжить получать обновления и оптимизированную поддержку.' . "\0" . 'В ваших подписках на расширение WooCommerce не указан способ оплаты для продления. Добавьте способ оплаты, чтобы продолжить получать обновления и оптимизированную поддержку.' . "\0" . 'В ваших подписках на расширение WooCommerce не указан способ оплаты для продления. Добавьте способ оплаты, чтобы продолжить получать обновления и оптимизированную поддержку.','Your {site_title} account has been created!'=>'Ваш аккаунт на {site_title} создан!','Your {site_title} order #{order_number} has been partially refunded'=>'Ваш заказ на сайте {site_title} № {order_number} был частично возвращён','Your {site_title} order #{order_number} has been refunded'=>'Ваш заказ на сайте {site_title} № {order_number} был возвращен','Your {site_title} order has been received!'=>'Ваш заказ на сайте {site_title} оформлен!','Your {site_title} order is now complete'=>'Ваш заказ на сайте {site_title} выполнен','Yo