угих).' . "\0" . '⚠ Обнаружены несовместимые плагины (%1$s, %2$s и %3$d других).','⚠ This plugin is incompatible with the enabled WooCommerce feature \'%s\', it shouldn\'t be activated.'=>'⚠ Этот плагин несовместим с включенной функцией WooCommerce «%s», его не следует активировать.','⚠ This plugin is incompatible with the enabled WooCommerce features \'%1$s\' and \'%2$s\', it shouldn\'t be activated.'=>'⚠ Плагин не следует активировать из-за несовместимости с используемыми функциями WooCommerce: %1$s и %2$s.','⚠ This plugin is incompatible with the enabled WooCommerce features \'%1$s\', \'%2$s\' and %3$d more, it shouldn\'t be activated.'=>'⚠ Плагин не следует активировать из-за несовместимости с используемыми функциями WooCommerce: %1$s, %2$s и ещё %3$d.','⚠ Usage tracking must be enabled to use remote logging.'=>'⚠ Для удалённого ведения журнала необходимо включить отслеживание использования.','⚠️ Only %s files can be searched at one time. Try filtering the file list before searching.'=>'⚠️ Одновременно можно осуществлять поиск не более %s файлов. Попробуйте отфильтровать список файлов перед поиском.','⚠️ The file system connection could not be initialized.'=>'⚠️ Не удалось настроить подключение к файловой системе.','⚠️ The file system is not configured for direct writes. This could cause problems for the logger.'=>'⚠️ Файловая система не настроена на прямую запись. Это может вызвать проблемы в работе журнала.','⚠️ The WooCommerce Legacy REST API has been moved to <a target=”_blank” href="%1$s">a dedicated extension</a>. <b><a target=”_blank” href="%2$s">Learn more about this change</a></b>'=>'⚠️ Устаревшее расширение WooCommerce REST API перемещено в <a target=”_blank” href="%1$s">указанное расширение</a>. <b><a target=”_blank” href="%2$s">Подробнее об этом изменении.</a></b>','⚠️ The WooCommerce Legacy REST API has been removed from WooCommerce, this will cause <a href="%1$s">webhooks on this site that are configured to use the Legacy REST API</a> to stop working. <a target="_blank" href="%2$s">A separate WooCommerce extension is available</a> to allow these webhooks to keep using the Legacy REST API without interruption. You can also edit these webhooks to use the current REST API version to generate the payload instead. <b><a target="_blank" href="%3$s">Learn more about this change.</a></b>'=>'⚠️ Устаревший WooCommerce REST API удалён из WooCommerce, это приводит к тому, что <a href="%1$s">вебзацепы, настроенные на использование устаревшего REST API</a>, больше не могут работать. Доступно <a target="_blank" href="%2$s">отдельное расширение для WooCommerce</a>, позволяющее вебзацепам продолжать использовать устаревший REST API. Также можно изменить вебзацепы, чтобы вместо устаревшей использовать текущую версию REST API для генерирования нагрузки. <b><a target="_blank" href="%3$s">Узнать больше о данном изменении</a>.</b>','⚠️ This directory does not appear to be writable.'=>'⚠️ Директория недоступна для записи.','⚠️ WooCommerce attempted to install <a href="%1$s">the Legacy REST API plugin</a> because this site has <a href="%2$s">the Legacy REST API enabled</a> or has <a href="%3$s">legacy webhooks defined</a>, but the installation failed (see error details in <a href="%4$s">the WooCommerce logs</a>). Please install and activate the plugin manually. <a href="%5$s">More information</a>'=>'⚠️ WooCommerce попытался установить <a href="%1$s">плагин Legacy REST API</a>, поскольку на этом сайте <a href="%2$s">включен устаревший REST API</a> или <a href="%3$s">определены устаревшие вебзацепы</a>, но установка завершилась неудачно (подробности об ошибке смотрите в <a href="%4$s">журналах WooCommerce</a>). Пожалуйста, установите и активируйте плагин вручную. <a href="%5$s">Дополнительная информация</a>.','⚠️ WooCommerce installed <a href="%1$s">the Legacy REST API plugin</a> because this site has <a href="%2$s">the Legacy REST API enabled</a> or has <a href="%3$s">legacy webhooks defined</a>, but it failed to activate it (see error details in <a href="%4$s">the WooCommerce logs</a>). Please go to <a href="%5$s">the plugins page</a> and activate it manually. <a href="%6$s">More information</a>'=>'⚠️ WooCommerce установил <a href="%1$s">плагин Legacy REST API</a>, потому что на этом сайте <a href="%2$s">включен устаревший REST API</a> или <a href="%3$s">устаревшие вебзацепы определены</a>, но активировать их не удалось (подробности об ошибке смотрите в <a href="%4$s">журналах WooCommerce</a>). Необходимо перейти на <a href="%5$s">страницу плагинов</a> и активируйте его вручную. <a href="%6$s">Дополнительная информация</a>.','✅ Ready'=>'✅ Готово','🎉 Congrats on adding your first product!'=>'🎉 Поздравляем с добавлением первого товара!']];
